diuide trinitatis obsecro.\nInc. tabula meditacionum vite Ihesu Christi sec. Bonauenturam.\nf. 19 - Inc. prologus meditacionum vite Saluatoris nostri I. C.\nf. 20 - Inter alia virtutum et laudum -  et ideo de ipsis videamus.\nc. i. Cum per longissima tempora\nf. 20-86b - c. cxxi - De modo meditandi etc, subesse desingnauit. hec Bernardus. Et sic finitur liber. Deo gracias (bis). \nExpl. medit. quas composuit ven. Cardinalis Bonauentura, de vita passione et morte saluatoris nostri I. C. deo gracias.',17,1),(369,'items','Vita S Jacobi apostoli (Emmanuel College, MS 241)','Cambridge, Emmanuel College, MS 241\nVita S Jacobi apostoli\nVita S Jacobi apostoli (Emmanuel College, MS 241)\n3\nLatin\n0\nf. 86b - Inc. vita S. Jacobi apostoli vocati fratris domini cum noua addicione\nCogitaui ego quidem carthuensis monachus illo nomine indignus predicatur et rudis\nHe seems to take the text of the Legenda Aurea and expound it. \nEnds f. 103: Osanna in excelsis. Saluum fac in celis, quo nos perducat qui uiuit et regnat deus per omnia sec. sec. Amen. \nExpl. vita b. Jacobu ap. vocati fratris domini cum noua addicione, quam apposuit quidam monachus modicus et minutus sed miser magnus in domo Ihesu de betleeem iuxta scheme ad. 1474 tempore messis. Deo gracias. Aspice in me domine et miserere mei secundum iudicium diligencium nomen tuum. Amen.\nff. 86v-103',17,1),(370,'items','Biblical table of contents (Inc. tabula super Bibliam) (Emmanuel College, MS 241)','Cambridge, Emmanuel College, MS 241\nBiblical table of contents (Inc. tabula super Bibliam) (Emmanuel College, MS 241)\n4\nLatin\n0\nf. 103b - Inc. tabula super Bibliam. Genesis i. Creauit deus celum et terram. \nAn epitome of each chapter of the Bible\nEnds f. 147 - qui apposuerit vel diminuerit de verbis prophecie libri huius etc. \nExpl. tabula super bibliam. Deo gracias. \nf. 107 - A table of subjects\nParchment\nff. 103-147',17,1),(371,'items','Mechtilde de Hackeborn, 1241-1299, sainte','Mechtilde de Hackeborn, 1241-1299, s