ni (1988)\nConnolly (1994): The first five items, none of which is complete, form a collection of meditative material which is given the general heading \'Fervor Amoris\'. This heading is used elsewhere as a title for the text more familiarly known as Contemplations ofthe Dread and Love of God, the seventh item in Arundel 197.* The appearance of this heading at the top off. 1r is interesting, and must be either a mistake on the part of the scribe, or, as seems more likely, given the sequence and nature of these short texts, evidence of an attempt to compose a new work altogether, possibly re-writing Contemplations in the process. Redrafting is a characteristic of the manuscript as a whole. What is curious about this otherwise unremarkable collection of devotional pieces is that the text of each work has been subjected to extensive revision, with lengthy additions and omissions, and many corrections to individual words and phrases. The result is that the texts within Arundel 197 differ significantly from their other witnesses elsewhere.\nParchment\n192 x 132 mm\n73\nhttps://www.bl.uk/eblj/1994articles/pdf/article4.pdf Connolly (1994) - manuscript description\nhttp://searcharchives.bl.uk/IAMS_VU2:IAMS040-002039480 Online catalogue entry\nVery plain, without decoration',17,1),(455,'items','A Ful Good Meditacioun for Oon to Seie by Him-self Al-oone (BL, Arundel MS 197)','London, British Library, Arundel MS 197\nA Ful Good Meditacioun for Oon to Seie by Him-self Al-oone\nA Ful Good Meditacioun for Oon to Seie by Him-self Al-oone (BL, Arundel MS 197)\n1\nEnglish, Middle\n0\nWith chapter AB of Contemplations of the Dread and Love of God interpolated on ff. 1v-3r\nff. 1r-3v',17,1),(457,'items','The Meditation of St Anselm','Anselm of Canterbury, 1033-1109\nThe Meditation of St Anselm\nLatin\n0',17,1),(458,'items','The Meditation of St Anselm (BL, Arundel MS 197)','London, British Library, Arundel MS 197\nThe Meditation of St Anselm\nThe Meditation of St Anselm (BL, Arundel 