 MS 317)\n5\nSymon Wynter\nSheen Charterhouse\nEnglish, Middle\n1\nSymon Wynter, amplification of the Life of St. Jerome, drawn from the\nLegenda aurea and from the apocryphal correspondence between Sts. Cyril and\nAugustine, and supplemented with revelations of St. Birgitta.  The scribe in\nthis manuscript has also added material concerning the story of St. Jerome and\nthe lion taken from the Legenda aurea (ff. 20r-21r).\nPaper\nff. 5r-21v',17,1),(536,'items','Recogition of Symon Wynter as the author of the Life of Saint Jerome in inscription','New Haven, Yale University, Beinecke MS 317\nRecogition of Symon Wynter as the author of the Life of Saint Jerome in inscription\n[Referenced in inscription]\n1\nSymon Wynter\nIn the upper margin of f. 5r has been added by a contemporary hand the name of the author, Symon Wynter; in the lower margin, by another hand:  \"This book to hym that lovyth god and the helth of his owen soule is bettyre than eny erthly tresoure.  And so wolle he say that redyth or heryth hit.  ffor with out the knowlych of the matere that is wryten in this booke, no man may fle evyll and do wele.  the which is don for love or drede.  or payne or ioye.  vt patebit.\"  This passage was then struck out and the statement added:  \"Beware of fals englysshe.\"',17,1),(537,'items','Latin prayers to Saint Jerome (inc. Iste est qui ante deum magnas virtutes operatus est)  (Yale, Beinecke MS 317','New Haven, Yale University, Beinecke MS 317\nLatin prayers to Saint Jerome (inc. Iste est qui ante deum magnas virtutes operatus est)  (Yale, Beinecke MS 317\n6\nSheen Charterhouse\nLatin\n0\nPaper\n7\nf. 21v',17,1),(538,'items','Lay Folks\' Catechism (first part) (Yale, Beinecke MS 317)','New Haven, Yale University, Beinecke MS 317\nLay Folks\' Catechism\nLay Folks\' Catechism (first part) (Yale, Beinecke MS 317)\n7\nSheen Charterhouse\nEnglish, Middle\n0\nPaper\nff. 21v-22r',17,1),(539,'items','Middle English verse (inc. That blissful bairn in Bethlehem born) (Yale, Beinecke MS 317)','Middle English verse (inc. That blissful bairn in Bethlehem born) (Yale, Beinecke MS 317)\nNew Haven, Yale University, Beinecke MS 317\nMiddle English verse (inc. That blissful bairn in Bethlehem born)\n8\nSheen Charterhouse\nEnglish, Middle\n0\nThe Virtues of the Mass ó 281 5-line stanzas\nPaper\nff. 22r-27v',17,1),(540,'items','Prose commentary on the Mass (Yale, Beinecke MS 317)','New Haven, Yale University, Beinecke MS 317\nProse commentary on the Mass\nProse commentary on the Mass (Yale, Beinecke MS 317)\n9\nEnglish, Middle\n0\nThe final portion of text, beginning on f. 29v (Thyse be the tokenys and condycionys of a vycyows preste...), has been crossed out.\nPaper\nff. 27v-30r',17,1),(541,'items','Lay Folks\' Catechism (second part) (Yale, Beinecke MS 317)','New Haven, Yale University, Beinecke MS 317\nLay Folks\' Catechism\nLay Folks\' Catechism (second part) (Yale, Beinecke MS 317)\n10\nEnglish\n0\nThe conclusion of the Lay Folks\' Catechism begun in art. 7, including texts on the 14 Articles of the Creed, 10 Commandments, 7 Sacraments, 7 Gifts of the Holy Ghost, 7 Deadly Sins, 7 Principal Virtues, 7 Deeds of Mercy.\nPaper\nff. 30v-34r',17,1),(542,'items','Miscellaneous (Hec in constitutionibus prouincialibus.  capitulum Ignorancia sacerdotum.  Euery synfull man and woman yn this worlde that assendyth theire lorde god...vt [?] aduertenti.) (Yale, Beinecke MS 317)','New Haven, Yale University, Beinecke MS 317\nMiscellaneous (Hec in constitutionibus prouincialibus.  capitulum Ignorancia sacerdotum.  Euery synfull man and woman yn this worlde that assendyth theire lorde god...vt [?] aduertenti.) (Yale, Beinecke MS 317)\n11\nSheen Charterhouse\n0\nPaper\nf. 34r',17,1),(543,'items','General confession (Inc. Here folowyth a fourme of a generall confessyoun that euery crysten man and woman is bownde to kunne and knowe and therfor whan a man comyth to his gostly fadir) (Yale, Beinecke MS 317)','New Haven, Yale University, Beinecke MS 317\nGeneral