 lorde)\nGeneral confession (inc. Beholde how the seek soule of mankynde sore woundyd knawynge his freelte dystresse and peryll cryeth to oure moste mercyful lorde) (Yale, Beinecke MS 317)\n15\nSheen Charterhouse\n0\nBeholde how the seek soule of mankynde sore woundyd knawynge his freelte dystresse and peryll cryeth to oure moste mercyful lorde... mercy of oure most mercyfull lord Ihesu cryste now and euer Amen.\n\nFor similar forms of confession see P. S. Jolliffe, ed., A Check-list of Middle English Prose Writings of Spiritual Guidance (Toronto, 1974) pp. 69-73.  This confession appears to be an expanded version of one found in Beinecke MS 163, ff. 179r-183v.\nPaper\nff. 42-50v',17,1),(547,'items','Vision in which the Virgin Mary reveals to John the Evangelist her five sorrows (Yale, Beinecke MS 317)','New Haven, Yale University, Beinecke MS 317\nVision in which the Virgin Mary reveals to John the Evangelist her five sorrows\nVision in which the Virgin Mary reveals to John the Evangelist her five sorrows (Yale, Beinecke MS 317)\n16\nSheen Charterhouse\nEnglish, Middle\n0\nPaper\nff. 50v-51r',17,1),(548,'items','Latin notes (Yale, Beinecke MS 317)','New Haven, Yale University, Beinecke MS 317\nLatin and Middle English verse (inc. Ave Maria Maiden immaculate)\nLatin notes (Yale, Beinecke MS 317)\n17\nSheen Charterhouse\nLatin\n0\nMany Latin notes, in several hands, tightly squeezed together, including sections labelled Augustinus in confessionibus; de ascensione; de temptacione.  Folios 53-55 are mutilated; f. 56 is torn in half with the upper portion missing.  On f. 54v appears \"Aue maria mayden ymmaculate/ Eram plena et humylyte/ dominus tecum bothe erthely and late/...ventris tui Ihesus on vs have mercy\"; and some proverbs, in Middle English and Latin, beginning: \"By a lytel hoole beholdeth man his frend/ Per specular modicum speculatur amicus amicum/...(cf. B. J. Whiting, Proverbs, Sentences and Proverbial Phrases...[Cambridge, 1968] p. 284, H 414).\nPaper\nf