 a prayer enclosed in interlaced rectangles and surrounded by symbols of kingship.\nParchment\nSections 1-7',17,1),(792,'items','Extract from Revelations (Philadelphia, Free Library, MS Lewis E 201)','Philadelphia, Free Library, MS Lewis E 201\nRevelations, 4.3\nExtract from Revelations (Philadelphia, Free Library, MS Lewis E 201)\nSecretary\n1475\nLatin\n1\nRev 4.3 selection\nEdward\'s genealogy ends in this section with his name inscribed above a prayer enclosed in interlaced rectangles and surrounded by symbols of kingship. The prayer includes mention of Birgitta\'s name and extracts from her Revelations.\nParchment\nSection 7',17,1),(793,'items','Oxford, Bodleian Library, MS Ashmole Rolls 27','Oxford, UK\nBodleian Library\nGenealogy of Edward IV, including a Chronicle of the World from Creation (Bodleian, MS Ashmole Rolls 27)\nExtracts from commentary on Carmina Vaticinalia (Bodleian, MS Ashmole Rolls 27)\nGenealogy of the descendants of Edward III to Prince Edward V (Bodleian, MS Ashmole Rolls 27)\nGenealogy of Louis son of Philip king of France to Edward IV and Henry VI (Bodleian, MS Ashmole Rolls 27)\nManifest against the murderers of Richard II (inc. Videte et intelligite quomodo Henricus Derby) (Bodleian, MS Ashmole Rolls 27)\nOn the right of Edward IV to the crown of France by lawful succession through Roger Mortiner Earl of March (Bodleian, MS Ashmole Rolls 27)\nAbout the prophecies of the Sibyl, the eagle, Merlin and Cadwallader (Bodleian, MS Ashmole Rolls 27)\nOxford, Bodleian Library, MS Ashmole Rolls 27\n[Manuscript]\n1400-1500\n1\nLong vellum roll detailing the genealogy of Edward IV from Adam through Christ and the kings of Britain, the princes of Wales, and the Anglo-Saxon and Normandian kings.\nParchment\n4 membranes\nhttps://medieval.bodleian.ox.ac.uk/images/ms/aeh/aeh0011.gif Catalogue link',17,1),(794,'items','Genealogy of Edward IV, including a Chronicle of the World from Creation','Genealogy of Edward IV, including a Chronicle of the World from Creation\n0',17,1),(795,'items','Genealogy of Edward IV, including a Chronicle of the World from Creation (Bodleian, MS Ashmole Rolls 27)','Oxford, Bodleian Library, MS Ashmole 27\nGenealogy of Edward IV, including a Chronicle of the World from Creation\nGenealogy of Edward IV, including a Chronicle of the World from Creation (Bodleian, MS Ashmole Rolls 27)\nLatin\n0\nParchment',17,1),(796,'items','John Twenge, Brits presbyter (1319-1379)','John Twenge, Brits presbyter (1319-1379)\nJohn of Bridlington\nPrior and English saint',17,1),(797,'items','Carmina Vaticinalia','John Twenge, Brits presbyter (1319-1379)\nCarmina Vaticinalia\n0',17,1),(798,'items','Extracts from commentary on Carmina Vaticinalia (Bodleian, MS Ashmole Rolls 27)','Oxford, Bodleian Library, MS Ashmole 27\nCarmina Vaticinalia\nExtracts from commentary on Carmina Vaticinalia (Bodleian, MS Ashmole Rolls 27)\nLatin\n0\nParchment',17,1),(799,'items','Genealogy of Louis son of Philip king of France to Edward IV and Henry VI (Bodleian, MS Ashmole Rolls 27)','Oxford, Bodleian Library, MS Ashmole Rolls 27\nRevelations, 4.3\nRevelations, 4.103/104-105\nGenealogy of Louis son of Philip king of France to Edward IV and Henry VI (Bodleian, MS Ashmole Rolls 27)\nLatin\n1\nRev IV.3, 103-5\nAccompanied by an extract from the Revelations of St Bridget thus headed - \"Sancta Birgitta floruit ab anno Domini 1355. et postea\" etc (inc. Orante Christi sponsa beata Brigitta). The scribe amends the cited Revelations text of Book IV, chapter 3 to textually isolate the French from a traditional source of divine support. In the original text, St Dionysius had asked the Virgin Mary to have mercy on France, but in Ashmol 27, the scribe separates the Frence from a traditional source of protection and justification  (Ellis 1982:173).  Both Cotton Vespasian E.vii  and Ashmole 27 used IV, iii to attack the usurpation of Henry IV and to urge the rights of Edward IV, who assumed the Crown in 1464.\nAlso accompanied by an extract 