oems (BL, Harley MS 1706)\nMedical recipes (BL, Harley MS 1706)\nLondon, British Library, Harley MS 1706\n1474-1524\nEngland\n1\nCollation of 2 manuscripts\nThe manuscript is a renowned collection of verse and prose devotional literature in Middle English including works by John Lydgate, Richard Rolle and Henry Suso. It is divided in two parts (ff. 3r-95v and 96r-216v). The flyleaves that precede and append the literary texts include a number of medical recipes (ff. 1v-2v and 215r-216r).\nParchment\n265 x 193 mm\n216\nviii + 216\nhttp://www.bl.uk/manuscripts/FullDisplay.aspx?ref=Harley_MS_1706 Online catalogue entry',17,1),(940,'items','Medical recipies (BL, Harley MS 1706)','London, British Library, Harley MS 1706\nMedical recipies (BL, Harley MS 1706)\n1\nGothic\nEnglish, Middle\n0\nParchment\nff. 1r-2v',17,1),(941,'items','Miscellany of devotional literature in prose and verse (BL, Harley MS 1706)','London, British Library, Harley MS 1706\nMiscellany of devotional literature in prose and verse (BL, Harley MS 1706)\nII - 1-27\nGothic\nEnglish, Middle\nLarge puzzle initials (2-7 lines) in blue and red with red pen-flourishing extending along the bounding lines. Initials in blue with red pen-flourishing and paragraph marks in alternating blue and red. Drawing of the Death as a skeleton with a bell and spear (f. 19v).\n1\nThis part of the manuscript was probably copied from an almost contemporary exemplar, now Oxford, Bodleian Library, Douce 322\nParchment\nff. 3r-95v',17,1),(942,'items','A prose confession of the Seven Deadly Sins (BL, Harley MS 1706)','London, British Library, Harley MS 1706\nA prose confession of the Seven Deadly Sins (BL, Harley MS 1706)\nII - 7\nGothic\nEnglish, Middle\n0\nParchment\nff. 17v-18r',17,1),(943,'items','Scala Claustralium (Middle English translation) (BL, Harley MS 1706)','London, British Library, Harley MS 1706\nScala Claustralium\nScala Claustralium (Middle English translation) (BL, Harley MS 1706)\nII - 15\nGothic\nEnglish, Middle\n0\nThere is only one other known copy, Cambridge University Library Ff vi. 33, which was written c. 1500 by a Carthusian monk at Sheen\nParchment\nff. 47v-54r',17,1),(944,'items','De emendatione vitae (BL, Harley MS 1706)','London, British Library, Harley MS 1706\nDe emendatione vitae\nDe emendatione vitae (BL, Harley MS 1706)\nII - 18\nGothic\nEnglish, Middle\n0\nOne of several versions of this text with Richard Rolle\'s name and date of birth and tables of chapters; entitled \'the xii chapitres whyche Richard Hampole the Ermyte made howe that a man shulde lyve in contemplacion\'\nParchment\nff. 67r-80v',17,1),(945,'items','Contemplations, Chapter AB, What maner men or women of simple conning mowe thenke or preie in her begynning (BL, Harley MS 1706)','London, British Library, Harley MS 1706\nContemplations, Chapter AB, What maner men or women of simple conning mowe thenke or preie in her begynning\nContemplations, Chapter AB, What maner men or women of simple conning mowe thenke or preie in her begynning (BL, Harley MS 1706)\nII - 21\nGothic\nEnglish, Middle\n1\nThe last chapter of the \'Contemplations of the Dread and Love of God\' (AB) and \'a confession whyche ys also a prayer made by Seynt Brandon\'\nParchment\nff. 84r-88r',17,1),(946,'items','Extract from The Pore Caitiff (BL, Harley MS 1706)','London, British Library, Harley MS 1706\nPore Caitiff\nExtract from The Pore Caitiff (BL, Harley MS 1706)\nII - 22\nEnglish, Middle\n1\nThe Poor Caitiff, a theological compendium, extract entitled: \'the Charter of hevynly herytage\'\nParchment\nff. 88r-90r',17,1),(947,'items','Miscellany of devotional literature in prose and verse (BL, Harley MS 1706)','London, British Library, Harley MS 1706\nMiscellany of devotional literature in prose and verse (BL, Harley MS 1706)\nIII - 1-7\nGothic\nEnglish, Middle\nPuzzle initials in red and brown with red and brown pen-flourishing forming marginal extensions. Initials in red with pen-flourishing in brown. Paraphs in red\n1\nParchment\nff. 96r-214v',17,1),(948,'items','Complaint of the dying creature','Complaint of the dying creature\n0',17,1),(949,'items','Complaint of the dying creature (BL, Harley MS 1706)','London, British Library, Harley MS 1706\nComplaint of the dying creature\nComplaint of the dying creature (BL, Harley MS 1706)\nIII - 1\nGothic\nEnglish, Middle\n0\nApart from this manuscript, this text is found only in four editions by Wynkyn de Worde (1506, 1507, 1514, and without a date, perhaps of 1531-34), but with different rubrics. According to Doyle 1958 (p. 230), both versions may have had a common model. A change of hands and layout from one to two columns occurs on f. 104v.\nParchment\nff. 96r-105v',17,1),(950,'items','The Mirror of Sinners and the Three Arrows (BL, Harley MS 1706)','London, British Library, Harley MS 1706\nSpeculum Peccatoris\nOf ﬁree Arwes ﬁat Schullen Bee Schot on Domesday\nThe Mirror of Sinners and the Three Arrows (BL, Harley MS 1706)\nIII - 2\nGothic\nEnglish, Middle\n0\nParchment\nff. 106r-114v',17,1),(951,'items','Form of Perfect Living (BL, Harley MS 1706)','London, British Library, Harley MS 1706\nForme of Lyvyng\nForm of Perfect Living (BL, Harley MS 1706)\nIII - 3\nGothic\nEnglish, Middle\n0\nExtract on four profitable things, used as a preface to a treatise on remedies against spiritual temptations (a Middle English adaptation of William Flete, De remediis contra temptaciones)\nParchment\nff. 114v-139v',17,1),(952,'items','Gadered counseylles of seynte Isodre (BL, Harley MS 1706)','London, British Library, Harley MS 1706\nGadered counseylles of seynte Isodre (BL, Harley MS 1706)\nIII - 4\nGothic\nEnglish, Middle\n0\nThe text is appended with the same pieces as its version earlier in the volume (Monita or Consilia Isidori, entitled here \'Consyderacion off man hym sylfe\' and a passage \'Augustinus de contemptu mundi\' followed by English and Latin verses - ff. 90r-93r), with an addition of the Nine Points of Perfection and another moral se