h, as can be seen through the Middle English inscription on f. 236v\nThere are a number of gaps in the texts, which points to the extent of the MS having been originally considerably greater. Further, a number of quires seems to have come out of order in binding; this is particularly noticeable in Rev. IV-VI',17,1),(1368,'items','Vita Beate Birgitte (Cremona, Biblioteca Governativa, MS 131)','Cremona, Biblioteca Governativa, MS 131\nVita Beate Birgitte\nVita Beate Birgitte (Cremona, Biblioteca Governativa, MS 131)\n1\nHand 1: 1r-9v\n1400-1450\nLatin\n1\nParchment\n1\nff. 1r-6v',17,1),(1369,'items','Revelations, Books 1-7 (Cremona, Biblioteca Governativa, MS 131)','Cremona, Biblioteca Governativa, MS 131\nRevelations, Books 1-7\nRevelations, Books 1-7 (Cremona, Biblioteca Governativa, MS 131)\n2\nHand 2: ff. 10-165\nHand 3: ff. 166-236\n1400-1450\nLatin\n1\nRev I, 14:3-60:10, Rev II-VII\nThe first 13 chapters and the beginning of chapter 14 are missing from the manuscript. The missing text of Revelations I and presumably a prologue was probably entered on a separate quire consisting of approximately 10 leaves.\nAfter book VII follows an account of where and when Birgitta died and when she was canonized.\nParchment\nff. 10r-236v',17,1),(1370,'items','Middle English inscription \"Jesu he that graciose ys haue mercy a pon hym ˛at wroth thys\" by English scribe','Cremona, Biblioteca Governativa, MS 131\nMiddle English inscription \"Jesu he that graciose ys haue mercy a pon hym ˛at wroth thys\" by English scribe\n[Annotate]\n0\nf. 236v',17,1),(1371,'items','Birgerus Gregorii -1383','Birgerus Gregorii -1383\nBirger Gregersson\nArchbishop of Uppsala',17,1),(1372,'items','Vita Beate Birgitte','Birgerus Gregorii -1383\nVita Beate Birgitte\nLatin\n1',17,1),(1373,'items','New Haven','New Haven',1,1),(1374,'items','Dublin, Ireland','Dublin, Ireland',1,1),(1375,'items','Isleworth, UK','Isleworth, UK',1,1),(1376,'items','Princeton, NJ','Princeton, NJ',1,1),(1377,'items','The Rosen