tle, whiche he se?t to a yo?g religyous man whom he moche loved. And after the sayd epistle, followeth four revelations of Saint Birget. (Hereafter foloweth the LXV. chapiter of the fyrst boke of Scala Perfectionis.)\n[Print]\nLondon, UK\nBritish Library\nSTC 1915.5, Golden epistle, 1530? (BL, C.37.b.12)\nLondon, British Library, C.37.b.12\nSTC 1915.5\n1530 ?\nLondon, UK\n1\nPaper\nhttp://explore.bl.uk/BLVU1:LSCOP-ALL:BLL01000292003 Online catalogue entry',17,1),(1404,'items','STC 1915.5, Golden epistle, 1530? (BL, C.37.b.12)','STC 1915.5, Golden epistle, 1530? (BL, C.37.b.12)\nLondon, British Library, C.37.b.12\nA Goldynn Pystill\nRevelations, 6.50\nRevelations, 6.65\nRevelations, 6.83\nRevelations, 6.41\nScala Perfectionis\n1530 ?\nLondon, UK\nThomas Godfray\nEnglish, Middle\n1\nIncludes four revelations of Saint Bridget. To this edition has also been added chapter 65 of: Hilton, Walter. Scale of perfection.\nPaper',17,1),(1405,'items','England','England',1,1),(1406,'items','Thomas Godfray','Thomas Godfray\nEnglish printer',17,1),(1412,'items','Lyon','Lyon',1,1),(1413,'items','Norwich Cathedral Priory','Norwich Cathedral Priory',1,1),(1414,'items','Paris','Paris',1,1),(1415,'items','Southern England','Southern England',1,1),(1419,'items','Imitatio Christi (Glasgow, Glasgow UL, Hunterian MS 136)','Imitatio Christi (Glasgow, Glasgow UL, Hunterian MS 136)\nGlasgow, University Library, Hunterian MS 136\nImitatio Christi\n1\nFere-textura\n1502\nEnglish, Middle\n0\nParchment\nff. 1-118',17,1);
