eSection','articleSection','Articles may belong to one or more \'sections\' in a magazine or newspaper, such as Sports, Lifestyle, etc.'),(915,14,11,'availableFrom','availableFrom','When the item is available for pickup from the store, locker, etc.'),(916,14,11,'applicationCategory','applicationCategory','Type of software application, e.g. \'Game, Multimedia\'.'),(917,14,11,'directors','directors','A director of e.g. tv, radio, movie, video games etc. content. Directors can be associated with individual items or with a series, episode, clip.'),(918,14,11,'multipleValues','multipleValues','Whether multiple values are allowed for the property.  Default is false.'),(919,14,11,'geoTouches','geoTouches','Represents spatial relations in which two geometries (or the places they represent) touch: they have at least one boundary point in common, but no interior points.\" (a symmetric relationship, as defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a> )'),(920,14,11,'dateModified','dateModified','The date on which the CreativeWork was most recently modified or when the item\'s entry was modified within a DataFeed.'),(921,14,11,'yearsInOperation','yearsInOperation','The age of the business.'),(922,14,11,'carbohydrateContent','carbohydrateContent','The number of grams of carbohydrates.'),(923,14,11,'cargoVolume','cargoVolume','The available volume for cargo or luggage. For automobiles, this is usually the trunk volume.<br/><br/>\n\nTypical unit code(s): LTR for liters, FTQ for cubic foot/feet<br/><br/>\n\nNote: You can use <a class=\"localLink\" href=\"http://schema.org/minValue\">minValue</a> and <a class=\"localLink\" href=\"http://schema.org/maxValue\">maxValue</a> to indicate ranges.'),(924,14,11,'isSimilarTo','isSimilarTo','A pointer to another, functionally similar product (or multiple products).'),(925,14,11,'assemblyVersion','assemblyVersion','Associated product/technology version. e.g., .NET Framework 4.5.'),(926,14,11,'dateRead','dateRead','The date/time at which the message has been read by the recipient if a single recipient exists.'),(927,14,11,'coverageStartTime','coverageStartTime','The time when the live blog will begin covering the Event. Note that coverage may begin before the Event\'s start time. The LiveBlogPosting may also be created before coverage begins.'),(928,14,11,'lyricist','lyricist','The person who wrote the words.'),(929,14,11,'albumProductionType','albumProductionType','Classification of the album by it\'s type of content: soundtrack, live album, studio album, etc.'),(930,14,11,'award','award','An award won by or for this item.'),(931,14,11,'priceComponent','priceComponent','This property links to all <a class=\"localLink\" href=\"http://schema.org/UnitPriceSpecification\">UnitPriceSpecification</a> nodes that apply in parallel for the <a class=\"localLink\" href=\"http://schema.org/CompoundPriceSpecification\">CompoundPriceSpecification</a> node.'),(932,14,11,'itemListOrder','itemListOrder','Type of ordering (e.g. Ascending, Descending, Unordered).'),(933,14,11,'additionalName','additionalName','An additional name for a Person, can be used for a middle name.'),(934,14,11,'embedUrl','embedUrl','A URL pointing to a player for a specific video. In general, this is the information in the <code>src</code> element of an <code>embed</code> tag and should not be the same as the content of the <code>loc</code> tag.'),(935,14,11,'expires','expires','Date the content expires and is no longer useful or available. For example a <a class=\"localLink\" href=\"http://schema.org/VideoObject\">VideoObject</a> or <a class=\"localLink\" href=\"http://schema.org/NewsArticle\">NewsArticle</a> whose availability or relevance is time-limited, or a <a class=\"localLink\" href=\"http://schema.org/ClaimReview\">ClaimReview</a> fact check whose publisher wants to indicate that it may no longer be relevant (or helpful to highlight) after some date.'),(936,14,11,'foodEvent','foodEvent','A sub property of location. The specific food event where the action occurred.'),(937,14,11,'ticketToken','ticketToken','Reference to an asset (e.g., Barcode, QR code image or PDF) usable for entrance.'),(938,14,11,'itemCondition','itemCondition','A predefined value from OfferItemCondition or a textual description of the condition of the product or service, or the products or services included in the offer.'),(939,14,11,'workFeatured','workFeatured','A work featured in some event, e.g. exhibited in an ExhibitionEvent.\n       Specific subproperties are available for workPerformed (e.g. a play), or a workPresented (a Movie at a ScreeningEvent).'),(940,14,11,'webCheckinTime','webCheckinTime','The time when a passenger can check into the flight online.'),(941,14,11,'isPartOf','isPartOf','Indicates an item or CreativeWork that this item, or CreativeWork (in some sense), is part of.'),(942,14,11,'upvoteCount','upvoteCount','The number of upvotes this question, answer or comment has received from the community.'),(943,14,11,'inLanguage','inLanguage','The language of the content or performance or used in an action. Please use one of the language codes from the <a href=\"http://tools.ietf.org/html/bcp47\">IETF BCP 47 standard</a>. See also <a class=\"localLink\" href=\"http://schema.org/availableLanguage\">availableLanguage</a>.'),(944,14,11,'subEvent','subEvent','An Event that is part of this event. For example, a conference event includes many presentations, each of which is a subEvent of the conference.'),(945,14,11,'vendor','vendor','\'vendor\' is an earlier term for \'seller\'.'),(946,14,11,'departureStation','departureStation','The station from which the train departs.'),(947,14,11,'recipient','recipient','A sub property of participant. The participant who is at the receiving end of the action.'),(948,14,11,'encodingType','encodingType','The supported encoding type(s) for an EntryPoint request.'),(949,14,11,'paymentDueDate','paymentDueDate','The date that payment is due.'),(950,14,11,'endDate','endDate','The end date and time of the item (in <a href=\"http://en.wikipedia.org/wiki/ISO_8601\">ISO 8601 date format</a>).'),(951,14,11,'expectedArrivalUntil','expectedArrivalUntil','The latest date the package may arrive.'),(952,14,11,'discusses','discusses','Specifies the CreativeWork associated with the UserComment.'),(953,14,11,'datasetTimeInterval','datasetTimeInterval','The range of temporal applicability of a dataset, e.g. for a 2011 census dataset, the year 2011 (in ISO 8601 time interval format).'),(954,14,11,'xpath','xpath','An XPath, e.g. of a <a class=\"localLink\" href=\"http://schema.org/SpeakableSpecification\">SpeakableSpecification</a> or <a class=\"localLink\" href=\"http://schema.org/WebPageElement\">WebPageElement</a>. In the latter case, multiple matches within a page can constitute a single conceptual \"Web page element\".'),(955,14,11,'percentile25','percentile25','The 25th percentile value.'),(956,14,11,'vehicleModelDate','vehicleModelDate','The release date of a vehicle model (often used to differentiate versions of the same make and model).'),(957,14,11,'replacee','replacee','A sub property of object. The object that is being replaced.'),(958,14,11,'occupancy','occupancy','The allowed total occupancy for the accommodation in persons (including infants etc). For individual accommodations, this is not necessarily the legal maximum but defines the permitted usage as per the contractual agreement (e.g. a double room used by a single person).\nTypical unit code(s): C62 for person'),(959,14,11,'recordedAs','recordedAs','An audio recording of the work.'),(960,14,11,'validIn','validIn','The geographic area where a permit or similar thing is valid.'),(961,14,11,'referenceQuantity','referenceQuantity','The reference quantity for which a certain price applies, e.g. 1 EUR per 4 kWh of electricity. This property is a replacement for unitOfMeasurement for the advanced cases where the price does not relate to a standard unit.'),(962,14,11,'catalog','cata