orksFor','worksFor','Organizations that the person works for.'),(1687,14,11,'issuedBy','issuedBy','The organization issuing the ticket or permit.'),(1688,14,11,'temporal','temporal','The \"temporal\" property can be used in cases where more specific properties\n(e.g. <a class=\"localLink\" href=\"http://schema.org/temporalCoverage\">temporalCoverage</a>, <a class=\"localLink\" href=\"http://schema.org/dateCreated\">dateCreated</a>, <a class=\"localLink\" href=\"http://schema.org/dateModified\">dateModified</a>, <a class=\"localLink\" href=\"http://schema.org/datePublished\">datePublished</a>) are not known to be appropriate.'),(1689,14,11,'authenticator','authenticator','The Organization responsible for authenticating the user\'s subscription. For example, many media apps require a cable/satellite provider to authenticate your subscription before playing media.'),(1690,14,11,'productionDate','productionDate','The date of production of the item, e.g. vehicle.'),(1691,14,11,'character','character','Fictional person connected with a creative work.'),(1692,14,11,'jobLocation','jobLocation','A (typically single) geographic location associated with the job position.'),(1693,14,11,'courseCode','courseCode','The identifier for the <a class=\"localLink\" href=\"http://schema.org/Course\">Course</a> used by the course <a class=\"localLink\" href=\"http://schema.org/provider\">provider</a> (e.g. CS101 or 6.001).'),(1694,14,11,'actionStatus','actionStatus','Indicates the current disposition of the Action.'),(1695,14,11,'birthDate','birthDate','Date of birth.'),(1696,14,11,'unsaturatedFatContent','unsaturatedFatContent','The number of grams of unsaturated fat.'),(1697,14,11,'fuelEfficiency','fuelEfficiency','The distance traveled per unit of fuel used; most commonly miles per gallon (mpg) or kilometers per liter (km/L).<br/><br/>\n\n<ul>\n<li>Note 1: There are unfortunately no standard unit codes for miles per gallon or kilometers per liter. Use <a class=\"localLink\" href=\"http://schema.org/unitText\">unitText</a> to indicate the unit of measurement, e.g. mpg or km/L.</li>\n<li>Note 2: There are two ways of indicating the fuel consumption, <a class=\"localLink\" href=\"http://schema.org/fuelConsumption\">fuelConsumption</a> (e.g. 8 liters per 100 km) and <a class=\"localLink\" href=\"http://schema.org/fuelEfficiency\">fuelEfficiency</a> (e.g. 30 miles per gallon). They are reciprocal.</li>\n<li>Note 3: Often, the absolute value is useful only when related to driving speed (\"at 80 km/h\") or usage pattern (\"city traffic\"). You can use <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a> to link the value for the fuel economy to another value.</li>\n</ul>\n'),(1698,14,11,'sharedContent','sharedContent','A CreativeWork such as an image, video, or audio clip shared as part of this posting.'),(1699,14,11,'reviewRating','reviewRating','The rating given in this review. Note that reviews can themselves be rated. The <code>reviewRating</code> applies to rating given by the review. The <a class=\"localLink\" href=\"http://schema.org/aggregateRating\">aggregateRating</a> property applies to the review itself, as a creative work.'),(1700,14,11,'departureGate','departureGate','Identifier of the flight\'s departure gate.'),(1701,14,11,'foundingDate','foundingDate','The date that this organization was founded.'),(1702,13,12,'actor','actor','The actor behind the activity, e.g. the sender of a letter.'),(1703,13,12,'carriesWork','carriesWork','A direct relation between the physical object and the immaterial work.'),(1704,13,12,'dataSource','dataSource',NULL),(1705,13,12,'foundOn','foundOn','The physical object where the written text is found on.'),(1706,13,12,'hasImage','hasImage','Link to IIIF image service'),(1707,13,12,'hasManifest','hasManifest','Link to IIIF manifest'),(1708,13,12,'hasTimeSpan','hasTimeSpan',NULL),(1709,13,12,'hasType','hasType','Type from from controlled vocabulary'),(1710,13,12,'identifiedBy','ide