INSERT INTO "resource_class" VALUES (1,NULL,1,'Agent','Agent','A resource that acts or has the power to act.'),(2,NULL,1,'AgentClass','Agent Class','A group of agents.'),(3,NULL,1,'BibliographicResource','Bibliographic Resource','A book, article, or other documentary resource.'),(4,NULL,1,'FileFormat','File Format','A digital resource format.'),(5,NULL,1,'Frequency','Frequency','A rate at which something recurs.'),(6,NULL,1,'Jurisdiction','Jurisdiction','The extent or range of judicial, law enforcement, or other authority.'),(7,NULL,1,'LicenseDocument','License Document','A legal document giving official permission to do something with a Resource.'),(8,NULL,1,'LinguisticSystem','Linguistic System','A system of signs, symbols, sounds, gestures, or rules used in communication.'),(9,NULL,1,'Location','Location','A spatial region or named place.'),(10,NULL,1,'LocationPeriodOrJurisdiction','Location, Period, or Jurisdiction','A location, period of time, or jurisdiction.'),(11,NULL,1,'MediaType','Media Type','A file format or physical medium.'),(12,NULL,1,'MediaTypeOrExtent','Media Type or Extent','A media type or extent.'),(13,NULL,1,'MethodOfInstruction','Method of Instruction','A process that is used to engender knowledge, attitudes, and skills.'),(14,NULL,1,'MethodOfAccrual','Method of Accrual','A method by which resources are added to a collection.'),(15,NULL,1,'PeriodOfTime','Period of Time','An interval of time that is named or defined by its start and end dates.'),(16,NULL,1,'PhysicalMedium','Physical Medium','A physical material or carrier.'),(17,NULL,1,'PhysicalResource','Physical Resource','A material thing.'),(18,NULL,1,'Policy','Policy','A plan or course of action by an authority, intended to influence and determine decisions, actions, and other matters.'),(19,NULL,1,'ProvenanceStatement','Provenance Statement','A statement of any changes in ownership and custody of a resource since its creation that are significant for its authenticity, integrity, and interpretation.'),(20,NULL,1,'RightsStatement','Rights Statement','A statement about the intellectual property rights (IPR) held in or over a Resource, a legal document giving official permission to do something with a resource, or a statement about access rights.'),(21,NULL,1,'SizeOrDuration','Size or Duration','A dimension or extent, or a time taken to play or execute.'),(22,NULL,1,'Standard','Standard','A basis for comparison; a reference point against which other things can be evaluated.'),(23,NULL,2,'Collection','Collection','An aggregation of resources.'),(24,NULL,2,'Dataset','Dataset','Data encoded in a defined structure.'),(25,NULL,2,'Event','Event','A non-persistent, time-based occurrence.'),(26,NULL,2,'Image','Image','A visual representation other than text.'),(27,NULL,2,'InteractiveResource','Interactive Resource','A resource requiring interaction from the user to be understood, executed, or experienced.'),(28,NULL,2,'Service','Service','A system that provides one or more functions.'),(29,NULL,2,'Software','Software','A computer program in source or compiled form.'),(30,NULL,2,'Sound','Sound','A resource primarily intended to be heard.'),(31,NULL,2,'Text','Text','A resource consisting primarily of words for reading.'),(32,NULL,2,'PhysicalObject','Physical Object','An inanimate, three-dimensional object or substance.'),(33,NULL,2,'StillImage','Still Image','A static visual representation.'),(34,NULL,2,'MovingImage','Moving Image','A series of visual representations imparting an impression of motion when shown in succession.'),(351,14,11,'LegalService','LegalService','A LegalService is a business that provides legally-oriented services, advice and representation, e.g. law firms.<br/><br/>\n\nAs a <a class=\"localLink\" href=\"http://schema.org/LocalBusiness\">LocalBusiness</a> it can be described as a <a class=\"localLink\" href=\"http://schema.org/provider\">provider</a> of one or more <a class=\"localLink\" href=\"http://schema.org/Service\">Service</a>(s).'),(352,14,11,'DepositAccount','DepositAccount','A type of Bank Account with a main purpose of depositing funds to gain interest or other benefits.'),(353,14,11,'RegisterAction','RegisterAction','The act of registering to be a user of a service, product or web page.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/JoinAction\">JoinAction</a>: Unlike JoinAction, RegisterAction implies you are registering to be a user of a service, <em>not</em> a group/team of people.</li>\n<li>[FollowAction]]: Unlike FollowAction, RegisterAction doesn\'t imply that the agent is expecting to poll for updates from the object.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/SubscribeAction\">SubscribeAction</a>: Unlike SubscribeAction, RegisterAction doesn\'t imply that the agent is expecting updates from the object.</li>\n</ul>\n'),(354,14,11,'DataDownload','DataDownload','A dataset in downloadable form.'),(355,14,11,'Table','Table','A table on a Web page.'),(356,14,11,'Course','Course','A description of an educational course which may be offered as distinct instances at which take place at different times or take place at different locations, or be offered through different media or modes of study. An educational course is a sequence of one or more educational events and/or creative works which aims to build knowledge, competence or ability of learners.'),(357,14,11,'WantAction','WantAction','The act of expressing a desire about the object. An agent wants an object.'),(358,14,11,'AllocateAction','AllocateAction','The act of organizing tasks/objects/events by associating resources to it.'),(359,14,11,'DigitalDocumentPermissionType','DigitalDocumentPermissionType','A type of permission which can be granted for accessing a digital document.'),(360,14,11,'AMRadioChannel','AMRadioChannel','A radio channel that uses AM.'),(361,14,11,'HighSchool','HighSchool','A high school.'),(362,14,11,'BankOrCreditUnion','BankOrCreditUnion','Bank or credit union.'),(363,14,11,'Product','Product','Any offered product or service. For example: a pair of shoes; a concert ticket; the rental of a car; a haircut; or an episode of a TV show streamed online.'),(364,14,11,'Conversation','Conversation','One or more messages between organizations or people on a particular topic. Individual messages can be linked to the conversation with isPartOf or hasPart properties.'),(365,14,11,'CableOrSatelliteService','CableOrSatelliteService','A service which provides access to media programming like TV or radio. Access may be via cable or satellite.'),(366,14,11,'ReservationPackage','ReservationPackage','A group of multiple reservations with common values for all sub-reservations.'),(367,14,11,'House','House','A house is a building or structure that has the ability to be occupied for habitation by humans or other creatures (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/House\">http://en.wikipedia.org/wiki/House</a>).'),(368,14,11,'BedType','BedType','A type of bed. This is used for indicating the bed or beds available in an accommodation.'),(369,14,11,'NightClub','NightClub','A nightclub or discotheque.'),(370,14,11,'Casino','Casino','A casino.'),(371,14,11,'ShoeStore','ShoeStore','A shoe store.'),(372,14,11,'ReservationStatusType','ReservationStatusType','Enumerated status values for Reservation.'),(373,14,11,'DeliveryMethod','DeliveryMethod','A delivery method is a standardized procedure for transferring the product or service to the destination of fulfillment chosen by the customer. Delivery methods are characterized by the means of transportation used, and by the organization or group that is the contracting party for the sending organization or person.<br/><br/>\n\nCommonly used values:<br/><br/>\n\n<ul>\n<li>http://purl.org/goodrelations/v1#DeliveryModeDirectDownload</li>\n<li>http://purl.org/goodrelations/v1#DeliveryModeFreight</li>\n<li>http://purl.org/goodrelations/v1#DeliveryModeMail</li>\n<li>http://purl.org/goodrelations/v1#DeliveryModeOwnFleet</li>\n<li>http://purl.org/goodrelations/v1#DeliveryModePickUp</li>\n<li>http://purl.org/goodrelations/v1#DHL</li>\n<li>http://purl.org/goodrelations/v1#FederalExpress</li>\n<li>http://purl.org/goodrelations/v1#UPS</li>\n</ul>\n'),(374,14,11,'CampingPitch','CampingPitch','A <a class=\"localLink\" href=\"http://schema.org/CampingPitch\">CampingPitch</a> is an individual place for overnight stay in the outdoors, typically being part of a larger camping site, or <a class=\"localLink\" href=\"http://schema.org/Campground\">Campground</a>.<br/><br/>\n\nIn British English a campsite, or campground, is an area, usually divided into a number of pitches, where people can camp overnight using tents or camper vans or caravans; this British English use of the word is synonymous with the American English expression campground. In American English the term campsite generally means an area where an individual, family, group, or military unit can pitch a tent or park a camper; a campground may contain many campsites.\n(Source: Wikipedia see <a href=\"https://en.wikipedia.org/wiki/Campsite\">https://en.wikipedia.org/wiki/Campsite</a>).<br/><br/>\n\nSee also the dedicated <a href=\"/docs/hotels.html\">document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),(375,14,11,'MusicComposition','MusicComposition','A musical composition.'),(376,14,11,'ParentAudience','ParentAudience','A set of characteristics describing parents, who can be interested in viewing some content.'),(377,14,11,'CityHall','CityHall','A city hall.'),(378,14,11,'HinduTemple','HinduTemple','A Hindu temple.'),(379,14,11,'Winery','Winery','A winery.'),(380,14,11,'GardenStore','GardenStore','A garden store.'),(381,14,11,'EducationalAudience','EducationalAudience','An EducationalAudience.'),(382,14,11,'TransferAction','TransferAction','The act of transferring/moving (abstract or concrete) animate or inanimate objects from one place to another.'),(383,14,11,'ChooseAction','ChooseAction','The act of expressing a preference from a set of options or a large or unbounded set of choices/options.'),(384,14,11,'ClothingStore','ClothingStore','A clothing store.'),(385,14,11,'RoofingContractor','RoofingContractor','A roofing contractor.'),(386,14,11,'FoodEstablishmentReservation','FoodEstablishmentReservation','A reservation to dine at a food-related business.<br/><br/>\n\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations.'),(387,14,11,'WPHeader','WPHeader','The header section of the page.'),(388,14,11,'MenuSection','MenuSection','A sub-grouping of food or drink items in a menu. E.g. courses (such as \'Dinner\', \'Breakfast\', etc.), specific type of dishes (such as \'Meat\', \'Vegan\', \'Drinks\', etc.), or some other classification made by the menu provider.'),(389,14,11,'ClaimReview','ClaimReview','A fact-checking review of claims made (or reported) in some creative work (referenced via itemReviewed).'),(390,14,11,'EmployeeRole','EmployeeRole','A subclass of OrganizationRole used to describe employee relationships.'),(391,14,11,'Organization','Organization','An organization such as a school, NGO, corporation, club, etc.'),(392,14,11,'BreadcrumbList','BreadcrumbList','A BreadcrumbList is an ItemList consisting of a chain of linked Web pages, typically described using at least their URL and their name, and typically ending with the current page.<br/><br/>\n\nThe <a class=\"localLink\" href=\"http://schema.org/position\">position</a> property is used to reconstruct the order of the items in a BreadcrumbList The convention is that a breadcrumb list has an <a class=\"localLink\" href=\"http://schema.org/itemListOrder\">itemListOrder</a> of <a class=\"localLink\" href=\"http://schema.org/ItemListOrderAscending\">ItemListOrderAscending</a> (lower values listed first), and that the first items in this list correspond to the \"top\" or beginning of the breadcrumb trail, e.g. with a site or section homepage. The specific values of \'position\' are not assigned meaning for a BreadcrumbList, but they should be integers, e.g. beginning with \'1\' for the first item in the list.'),(393,14,11,'DataFeedItem','DataFeedItem','A single item within a larger data feed.'),(394,14,11,'Apartment','Apartment','An apartment (in American English) or flat (in British English) is a self-contained housing unit (a type of residential real estate) that occupies only part of a building (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Apartment\">http://en.wikipedia.org/wiki/Apartment</a>).'),(395,14,11,'Flight','Flight','An airline flight.'),(396,14,11,'ToyStore','ToyStore','A toy store.'),(397,14,11,'BlogPosting','BlogPosting','A blog post.'),(398,14,11,'EducationEvent','EducationEvent','Event type: Education event.'),(399,14,11,'TelevisionChannel','TelevisionChannel','A unique instance of a television BroadcastService on a CableOrSatelliteService lineup.'),(400,14,11,'HowToItem','HowToItem','An item used as either a tool or supply when performing the instructions for how to to achieve a result.'),(401,14,11,'MedicalOrganization','MedicalOrganization','A medical organization (physical or not), such as hospital, institution or clinic.'),(402,14,11,'JobPosting','JobPosting','A listing that describes a job opening in a certain organization.'),(403,14,11,'RadioClip','RadioClip','A short radio program or a segment/part of a radio program.'),(404,14,11,'ExhibitionEvent','ExhibitionEvent','Event type: Exhibition event, e.g. at a museum, library, archive, tradeshow, ...'),(405,14,11,'ParkingFacility','ParkingFacility','A parking lot or other parking facility.'),(406,14,11,'PaymentService','PaymentService','A Service to transfer funds from a person or organization to a beneficiary person or organization.'),(407,14,11,'Review','Review','A review of an item - for example, of a restaurant, movie, or store.'),(408,14,11,'ChildCare','ChildCare','A Childcare center.'),(409,14,11,'BookSeries','BookSeries','A series of books. Included books can be indicated with the hasPart property.'),(410,14,11,'DanceGroup','DanceGroup','A dance group&#x2014;for example, the Alvin Ailey Dance Theater or Riverdance.'),(411,14,11,'PublicationEvent','PublicationEvent','A PublicationEvent corresponds indifferently to the event of publication for a CreativeWork of any type e.g. a broadcast event, an on-demand event, a book/journal publication via a variety of delivery media.'),(412,14,11,'EndorsementRating','EndorsementRating','An EndorsementRating is a rating that expresses some level of endorsement, for example inclusion in a \"critic\'s pick\" blog, a\n\"Like\" or \"+1\" on a social network. It can be considered the <a class=\"localLink\" href=\"http://schema.org/result\">result</a> of an <a class=\"localLink\" href=\"http://schema.org/EndorseAction\">EndorseAction</a> in which the <a class=\"localLink\" href=\"http://schema.org/object\">object</a> of the action is rated positively by\nsome <a class=\"localLink\" href=\"http://schema.org/agent\">agent</a>. As is common elsewhere in schema.org, it is sometimes more useful to describe the results of such an action without explicitly describing the <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>.<br/><br/>\n\nAn <a class=\"localLink\" href=\"http://schema.org/EndorsementRating\">EndorsementRating</a> may be part of a numeric scale or organized system, but this is not required: having an explicit type for indicating a positive,\nendorsement rating is particularly useful in the absence of numeric scales as it helps consumers understand that the rating is broadly positive.'),(413,14,11,'Preschool','Preschool','A preschool.'),(414,14,11,'DataType','DataType','The basic data types such as Integers, Strings, etc.'),(415,14,11,'EventVenue','EventVenue','An event venue.'),(416,14,11,'Vehicle','Vehicle','A vehicle is a device that is designed or used to transport people or cargo over land, water, air, or through space.'),(417,14,11,'AchieveAction','AchieveAction','The act of accomplishing something via previous efforts. It is an instantaneous action rather than an ongoing process.'),(418,14,11,'UserComments','UserComments','UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>-based vocabulary, alongside types such as <a class=\"localLink\" href=\"http://schema.org/Comment\">Comment</a>.'),(419,14,11,'ScheduleAction','ScheduleAction','Scheduling future actions, events, or tasks.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/ReserveAction\">ReserveAction</a>: Unlike ReserveAction, ScheduleAction allocates future actions (e.g. an event, a task, etc) towards a time slot / spatial allocation.</li>\n</ul>\n'),(420,14,11,'MediaObject','MediaObject','A media object, such as an image, video, or audio object embedded in a web page or a downloadable dataset i.e. DataDownload. Note that a creative work may have many media objects associated with it on the same web page. For example, a page about a single song (MusicRecording) may have a music video (VideoObject), and a high and low bandwidth audio stream (2 AudioObject\'s).'),(421,14,11,'InsuranceAgency','InsuranceAgency','An Insurance agency.'),(422,14,11,'Energy','Energy','Properties that take Energy as values are of the form \'&lt;Number&gt; &lt;Energy unit of measure&gt;\'.'),(423,14,11,'WPSideBar','WPSideBar','A sidebar section of the page.'),(424,14,11,'TipAction','TipAction','The act of giving money voluntarily to a beneficiary in recognition of services rendered.'),(425,14,11,'BuyAction','BuyAction','The act of giving money to a seller in exchange for goods or services rendered. An agent buys an object, product, or service from a seller for a price. Reciprocal of SellAction.'),(426,14,11,'Corporation','Corporation','Organization: A business corporation.'),(427,14,11,'ProductModel','ProductModel','A datasheet or vendor specification of a product (in the sense of a prototypical description).'),(428,14,11,'Answer','Answer','An answer offered to a question; perhaps correct, perhaps opinionated or wrong.'),(429,14,11,'EndorseAction','EndorseAction','An agent approves/certifies/likes/supports/sanction an object.'),(430,14,11,'SingleFamilyResidence','SingleFamilyResidence','Residence type: Single-family home.'),(431,14,11,'Dataset','Dataset','A body of structured information describing some topic(s) of interest.'),(432,14,11,'RestrictedDiet','RestrictedDiet','A diet restricted to certain foods or preparations for cultural, religious, health or lifestyle reasons.'),(433,14,11,'FoodEstablishment','FoodEstablishment','A food-related business.'),(434,14,11,'FireStation','FireStation','A fire station. With firemen.'),(435,14,11,'WebSite','WebSite','A WebSite is a set of related web pages and other items typically served from a single web domain and accessible via URLs.'),(436,14,11,'Hospital','Hospital','A hospital.'),(437,14,11,'Zoo','Zoo','A zoo.'),(438,14,11,'Clip','Clip','A short TV or radio program or a segment/part of a program.'),(439,14,11,'Mass','Mass','Properties that take Mass as values are of the form \'&lt;Number&gt; &lt;Mass unit of measure&gt;\'. E.g., \'7 kg\'.'),(440,14,11,'Offer','Offer','An offer to transfer some rights to an item or to provide a service ó for example, an offer to sell tickets to an event, to rent the DVD of a movie, to stream a TV show over the internet, to repair a motorcycle, or to loan a book.<br/><br/>\n\nFor <a href=\"http://www.gs1.org/barcodes/technical/idkeys/gtin\">GTIN</a>-related fields, see <a href=\"http://www.gs1.org/barcodes/support/check_digit_calculator\">Check Digit calculator</a> and <a href=\"http://www.gs1us.org/resources/standards/gtin-validation-guide\">validation guide</a> from <a href=\"http://www.gs1.org/\">GS1</a>.'),(441,14,11,'DeliveryEvent','DeliveryEvent','An event involving the delivery of an item.'),(442,14,11,'RiverBodyOfWater','RiverBodyOfWater','A river (for example, the broad majestic Shannon).'),(443,14,11,'Landform','Landform','A landform or physical feature.  Landform elements include mountains, plains, lakes, rivers, seascape and oceanic waterbody interface features such as bays, peninsulas, seas and so forth, including sub-aqueous terrain features such as submersed mountain ranges, volcanoes, and the great ocean basins.'),(444,14,11,'SubwayStation','SubwayStation','A subway station.'),(445,14,11,'SportsActivityLocation','SportsActivityLocation','A sports location, such as a playing field.'),(446,14,11,'EntertainmentBusiness','EntertainmentBusiness','A business providing entertainment.'),(447,14,11,'TVSeason','TVSeason','Season dedicated to TV broadcast and associated online delivery.'),(448,14,11,'CommentAction','CommentAction','The act of generating a comment about a subject.'),(449,14,11,'PaymentStatusType','PaymentStatusType','A specific payment status. For example, PaymentDue, PaymentComplete, etc.'),(450,14,11,'MotorcycleRepair','MotorcycleRepair','A motorcycle repair shop.'),(451,14,11,'Florist','Florist','A florist.'),(452,14,11,'Duration','Duration','Quantity: Duration (use <a href=\"http://en.wikipedia.org/wiki/ISO_8601\">ISO 8601 duration format</a>).'),(453,14,11,'SportsOrganization','SportsOrganization','Represents the collection of all sports organizations, including sports teams, governing bodies, and sports associations.'),(454,14,11,'TaxiService','TaxiService','A service for a vehicle for hire with a driver for local travel. Fares are usually calculated based on distance traveled.'),(455,14,11,'MovingCompany','MovingCompany','A moving company.'),(456,14,11,'CurrencyConversionService','CurrencyConversionService','A service to convert funds from one currency to another currency.'),(457,14,11,'Rating','Rating','A rating is an evaluation on a numeric scale, such as 1 to 5 stars.'),(458,14,11,'UserPlusOnes','UserPlusOnes','UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>-based vocabulary, alongside types such as <a class=\"localLink\" href=\"http://schema.org/Comment\">Comment</a>.'),(459,14,11,'HowToSection','HowToSection','A sub-grouping of steps in the instructions for how to achieve a result (e.g. steps for making a pie crust within a pie recipe).'),(460,14,11,'TheaterGroup','TheaterGroup','A theater group or company, for example, the Royal Shakespeare Company or Druid Theatre.'),(461,14,11,'RadioEpisode','RadioEpisode','A radio episode which can be part of a series or season.'),(462,14,11,'ComedyClub','ComedyClub','A comedy club.'),(463,14,11,'Cemetery','Cemetery','A graveyard.'),(464,14,11,'ListItem','ListItem','An list item, e.g. a step in a checklist or how-to description.'),(465,14,11,'HobbyShop','HobbyShop','A store that sells materials useful or necessary for various hobbies.'),(466,14,11,'PropertyValue','PropertyValue','A property-value pair, e.g. representing a feature of a product or place. Use the \'name\' property for the name of the property. If there is an additional human-readable version of the value, put that into the \'description\' property.<br/><br/>\n\nAlways use specific schema.org properties when a) they exist and b) you can populate them. Using PropertyValue as a substitute will typically not trigger the same effect as using the original, specific property.'),(467,14,11,'HomeGoodsStore','HomeGoodsStore','A home goods store.'),(468,14,11,'VideoGame','VideoGame','A video game is an electronic game that involves human interaction with a user interface to generate visual feedback on a video device.'),(469,14,11,'HealthAndBeautyBusiness','HealthAndBeautyBusiness','Health and beauty.'),(470,14,11,'JoinAction','JoinAction','An agent joins an event/group with participants/friends at a location.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/RegisterAction\">RegisterAction</a>: Unlike RegisterAction, JoinAction refers to joining a group/team of people.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/SubscribeAction\">SubscribeAction</a>: Unlike SubscribeAction, JoinAction does not imply that you\'ll be receiving updates.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/FollowAction\">FollowAction</a>: Unlike FollowAction, JoinAction does not imply that you\'ll be polling for updates.</li>\n</ul>\n'),(471,14,11,'GeoCircle','GeoCircle','A GeoCircle is a GeoShape representing a circular geographic area. As it is a GeoShape\n          it provides the simple textual property \'circle\', but also allows the combination of postalCode alongside geoRadius.\n          The center of the circle can be indicated via the \'geoMidpoint\' property, or more approximately using \'address\', \'postalCode\'.'),(472,14,11,'LocationFeatureSpecification','LocationFeatureSpecification','Specifies a location feature by providing a structured value representing a feature of an accommodation as a property-value pair of varying degrees of formality.'),(473,14,11,'DigitalDocumentPermission','DigitalDocumentPermission','A permission for a particular person or group to access a particular file.'),(474,14,11,'PhotographAction','PhotographAction','The act of capturing still images of objects using a camera.'),(475,14,11,'Question','Question','A specific question - e.g. from a user seeking answers online, or collected in a Frequently Asked Questions (FAQ) document.'),(476,14,11,'PayAction','PayAction','An agent pays a price to a participant.'),(477,14,11,'IgnoreAction','IgnoreAction','The act of intentionally disregarding the object. An agent ignores an object.'),(478,14,11,'ContactPoint','ContactPoint','A contact point&#x2014;for example, a Customer Complaints department.'),(479,14,11,'FoodService','FoodService','A food service, like breakfast, lunch, or dinner.'),(480,14,11,'ReviewAction','ReviewAction','The act of producing a balanced opinion about the object for an audience. An agent reviews an object with participants resulting in a review.'),(481,14,11,'WriteAction','WriteAction','The act of authoring written creative content.'),(482,14,11,'Country','Country','A country.'),(483,14,11,'School','School','A school.'),(484,14,11,'Restaurant','Restaurant','A restaurant.'),(485,14,11,'ItemListOrderType','ItemListOrderType','Enumerated for values for itemListOrder for indicating how an ordered ItemList is organized.'),(486,14,11,'Brand','Brand','A brand is a name used by an organization or business person for labeling a product, product group, or similar.'),(487,14,11,'LodgingReservation','LodgingReservation','A reservation for lodging at a hotel, motel, inn, etc.<br/><br/>\n\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations.'),(488,14,11,'RsvpResponseType','RsvpResponseType','RsvpResponseType is an enumeration type whose instances represent responding to an RSVP request.'),(489,14,11,'QuantitativeValue','QuantitativeValue','A point value or interval for product characteristics and other purposes.'),(490,14,11,'Embassy','Embassy','An embassy.'),(491,14,11,'HowToStep','HowToStep','A step in the instructions for how to achieve a result. It is an ordered list with HowToDirection and/or HowToTip items.'),(492,14,11,'ReadAction','ReadAction','The act of consuming written content.'),(493,14,11,'Beach','Beach','Beach.'),(494,14,11,'DefenceEstablishment','DefenceEstablishment','A defence establishment, such as an army or navy base.'),(495,14,11,'Blog','Blog','A blog.'),(496,14,11,'FindAction','FindAction','The act of finding an object.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/SearchAction\">SearchAction</a>: FindAction is generally lead by a SearchAction, but not necessarily.</li>\n</ul>\n'),(497,14,11,'HealthClub','HealthClub','A health club.'),(498,14,11,'Locksmith','Locksmith','A locksmith.'),(499,14,11,'Trip','Trip','A trip or journey. An itinerary of visits to one or more places.'),(500,14,11,'SportsEvent','SportsEvent','Event type: Sports event.'),(501,14,11,'Taxi','Taxi','A taxi.'),(502,14,11,'WearAction','WearAction','The act of dressing oneself in clothing.'),(503,14,11,'DaySpa','DaySpa','A day spa.'),(504,14,11,'SaleEvent','SaleEvent','Event type: Sales event.'),(505,14,11,'InvestmentOrDeposit','InvestmentOrDeposit','A type of financial product that typically requires the client to transfer funds to a financial service in return for potential beneficial financial return.'),(506,14,11,'UseAction','UseAction','The act of applying an object to its intended purpose.'),(507,14,11,'PlaceOfWorship','PlaceOfWorship','Place of worship, such as a church, synagogue, or mosque.'),(508,14,11,'MusicStore','MusicStore','A music store.'),(509,14,11,'RadioSeries','RadioSeries','CreativeWorkSeries dedicated to radio broadcast and associated online delivery.'),(510,14,11,'PublicationIssue','PublicationIssue','A part of a successively published publication such as a periodical or publication volume, often numbered, usually containing a grouping of works such as articles.<br/><br/>\n\nSee also <a href=\"http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html\">blog post</a>.'),(511,14,11,'AggregateRating','AggregateRating','The average rating based on multiple ratings or reviews.'),(512,14,11,'Painting','Painting','A painting.'),(513,14,11,'MusicEvent','MusicEvent','Event type: Music event.'),(514,14,11,'DayOfWeek','DayOfWeek','The day of the week, e.g. used to specify to which day the opening hours of an OpeningHoursSpecification refer.<br/><br/>\n\nOriginally, URLs from <a href=\"http://purl.org/goodrelations/v1\">GoodRelations</a> were used (for <a class=\"localLink\" href=\"http://schema.org/Monday\">Monday</a>, <a class=\"localLink\" href=\"http://schema.org/Tuesday\">Tuesday</a>, <a class=\"localLink\" href=\"http://schema.org/Wednesday\">Wednesday</a>, <a class=\"localLink\" href=\"http://schema.org/Thursday\">Thursday</a>, <a class=\"localLink\" href=\"http://schema.org/Friday\">Friday</a>, <a class=\"localLink\" href=\"http://schema.org/Saturday\">Saturday</a>, <a class=\"localLink\" href=\"http://schema.org/Sunday\">Sunday</a> plus a special entry for <a class=\"localLink\" href=\"http://schema.org/PublicHolidays\">PublicHolidays</a>); these have now been integrated directly into schema.org.'),(515,14,11,'OwnershipInfo','OwnershipInfo','A structured value providing information about when a certain organization or person owned a certain product.'),(516,14,11,'ParcelDelivery','ParcelDelivery','The delivery of a parcel either via the postal service or a commercial service.'),(517,14,11,'EmailMessage','EmailMessage','An email message.'),(518,14,11,'EntryPoint','EntryPoint','An entry point, within some Web-based protocol.'),(519,14,11,'HowTo','HowTo','Instructions that explain how to achieve a result by performing a sequence of steps.'),(520,14,11,'IndividualProduct','IndividualProduct','A single, identifiable product instance (e.g. a laptop with a particular serial number).'),(521,14,11,'VideoGallery','VideoGallery','Web page type: Video gallery page.'),(522,14,11,'RVPark','RVPark','A place offering space for \"Recreational Vehicles\", Caravans, mobile homes and the like.'),(523,14,11,'BusinessEvent','BusinessEvent','Event type: Business event.'),(524,14,11,'AutoRepair','AutoRepair','Car repair business.'),(525,14,11,'Church','Church','A church.'),(526,14,11,'UserPlays','UserPlays','UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>-based vocabulary, alongside types such as <a class=\"localLink\" href=\"http://schema.org/Comment\">Comment</a>.'),(527,14,11,'PaymentMethod','PaymentMethod','A payment method is a standardized procedure for transferring the monetary amount for a purchase. Payment methods are characterized by the legal and technical structures used, and by the organization or group carrying out the transaction.<br/><br/>\n\nCommonly used values:<br/><br/>\n\n<ul>\n<li>http://purl.org/goodrelations/v1#ByBankTransferInAdvance</li>\n<li>http://purl.org/goodrelations/v1#ByInvoice</li>\n<li>http://purl.org/goodrelations/v1#Cash</li>\n<li>http://purl.org/goodrelations/v1#CheckInAdvance</li>\n<li>http://purl.org/goodrelations/v1#COD</li>\n<li>http://purl.org/goodrelations/v1#DirectDebit</li>\n<li>http://purl.org/goodrelations/v1#GoogleCheckout</li>\n<li>http://purl.org/goodrelations/v1#PayPal</li>\n<li>http://purl.org/goodrelations/v1#PaySwarm</li>\n</ul>\n'),(528,14,11,'NutritionInformation','NutritionInformation','Nutritional information about the recipe.'),(529,14,11,'InsertAction','InsertAction','The act of adding at a specific location in an ordered collection.'),(530,14,11,'BowlingAlley','BowlingAlley','A bowling alley.'),(531,14,11,'FinancialService','FinancialService','Financial services business.'),(532,14,11,'TaxiReservation','TaxiReservation','A reservation for a taxi.<br/><br/>\n\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, use <a class=\"localLink\" href=\"http://schema.org/Offer\">Offer</a>.'),(533,14,11,'TextDigitalDocument','TextDigitalDocument','A file composed primarily of text.'),(534,14,11,'TieAction','TieAction','The act of reaching a draw in a competitive activity.'),(535,14,11,'BusinessEntityType','BusinessEntityType','A business entity type is a conceptual entity representing the legal form, the size, the main line of business, the position in the value chain, or any combination thereof, of an organization or business person.<br/><br/>\n\nCommonly used values:<br/><br/>\n\n<ul>\n<li>http://purl.org/goodrelations/v1#Business</li>\n<li>http://purl.org/goodrelations/v1#Enduser</li>\n<li>http://purl.org/goodrelations/v1#PublicInstitution</li>\n<li>http://purl.org/goodrelations/v1#Reseller</li>\n</ul>\n'),(536,14,11,'MoveAction','MoveAction','The act of an agent relocating to a place.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/TransferAction\">TransferAction</a>: Unlike TransferAction, the subject of the move is a living Person or Organization rather than an inanimate object.</li>\n</ul>\n'),(537,14,11,'TouristInformationCenter','TouristInformationCenter','A tourist information center.'),(538,14,11,'GovernmentPermit','GovernmentPermit','A permit issued by a government agency.'),(539,14,11,'LakeBodyOfWater','LakeBodyOfWater','A lake (for example, Lake Pontrachain).'),(540,14,11,'Series','Series','A Series in schema.org is a group of related items, typically but not necessarily of the same kind. See also <a class=\"localLink\" href=\"http://schema.org/CreativeWorkSeries\">CreativeWorkSeries</a>, <a class=\"localLink\" href=\"http://schema.org/EventSeries\">EventSeries</a>.'),(541,14,11,'DownloadAction','DownloadAction','The act of downloading an object.'),(542,14,11,'TrainTrip','TrainTrip','A trip on a commercial train line.'),(543,14,11,'ElectronicsStore','ElectronicsStore','An electronics store.'),(544,14,11,'PrependAction','PrependAction','The act of inserting at the beginning if an ordered collection.'),(545,14,11,'QualitativeValue','QualitativeValue','A predefined value for a product characteristic, e.g. the power cord plug type \'US\' or the garment sizes \'S\', \'M\', \'L\', and \'XL\'.'),(546,14,11,'TrainStation','TrainStation','A train station.'),(547,14,11,'TradeAction','TradeAction','The act of participating in an exchange of goods and services for monetary compensation. An agent trades an object, product or service with a participant in exchange for a one time or periodic payment.'),(548,14,11,'FoodEvent','FoodEvent','Event type: Food event.'),(549,14,11,'MusicRecording','MusicRecording','A music recording (track), usually a single song.'),(550,14,11,'LodgingBusiness','LodgingBusiness','A lodging business, such as a motel, hotel, or inn.'),(551,14,11,'Map','Map','A map.'),(552,14,11,'WebPageElement','WebPageElement','A web page element, like a table or an image.'),(553,14,11,'MapCategoryType','MapCategoryType','An enumeration of several kinds of Map.'),(554,14,11,'MusicVideoObject','MusicVideoObject','A music video file.'),(555,14,11,'TaxiStand','TaxiStand','A taxi stand.'),(556,14,11,'GameServerStatus','GameServerStatus','Status of a game server.'),(557,14,11,'Intangible','Intangible','A utility class that serves as the umbrella for a number of \'intangible\' things such as quantities, structured values, etc.'),(558,14,11,'ApplyAction','ApplyAction','The act of registering to an organization/service without the guarantee to receive it.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/RegisterAction\">RegisterAction</a>: Unlike RegisterAction, ApplyAction has no guarantees that the application will be accepted.</li>\n</ul>\n'),(559,14,11,'ScreeningEvent','ScreeningEvent','A screening of a movie or other video.'),(560,14,11,'Message','Message','A single message from a sender to one or more organizations or people.'),(561,14,11,'BroadcastFrequencySpecification','BroadcastFrequencySpecification','The frequency in MHz and the modulation used for a particular BroadcastService.'),(562,14,11,'City','City','A city or town.'),(563,14,11,'HowToSupply','HowToSupply','A supply consumed when performing the instructions for how to achieve a result.'),(564,14,11,'MusicAlbum','MusicAlbum','A collection of music tracks.'),(565,14,11,'Mountain','Mountain','A mountain, like Mount Whitney or Mount Everest.'),(566,14,11,'FollowAction','FollowAction','The act of forming a personal connection with someone/something (object) unidirectionally/asymmetrically to get updates polled from.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/BefriendAction\">BefriendAction</a>: Unlike BefriendAction, FollowAction implies that the connection is <em>not</em> necessarily reciprocal.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/SubscribeAction\">SubscribeAction</a>: Unlike SubscribeAction, FollowAction implies that the follower acts as an active agent constantly/actively polling for updates.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/RegisterAction\">RegisterAction</a>: Unlike RegisterAction, FollowAction implies that the agent is interested in continuing receiving updates from the object.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/JoinAction\">JoinAction</a>: Unlike JoinAction, FollowAction implies that the agent is interested in getting updates from the object.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/TrackAction\">TrackAction</a>: Unlike TrackAction, FollowAction refers to the polling of updates of all aspects of animate objects rather than the location of inanimate objects (e.g. you track a package, but you don\'t follow it).</li>\n</ul>\n'),(567,14,11,'WarrantyPromise','WarrantyPromise','A structured value representing the duration and scope of services that will be provided to a customer free of charge in case of a defect or malfunction of a product.'),(568,14,11,'BarOrPub','BarOrPub','A bar or pub.'),(569,14,11,'HousePainter','HousePainter','A house painting service.'),(570,14,11,'Periodical','Periodical','A publication in any medium issued in successive parts bearing numerical or chronological designations and intended, such as a magazine, scholarly journal, or newspaper to continue indefinitely.<br/><br/>\n\nSee also <a href=\"http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html\">blog post</a>.'),(571,14,11,'EmploymentAgency','EmploymentAgency','An employment agency.'),(572,14,11,'ConsumeAction','ConsumeAction','The act of ingesting information/resources/food.'),(573,14,11,'Hotel','Hotel','A hotel is an establishment that provides lodging paid on a short-term basis (Source: Wikipedia, the free encyclopedia, see http://en.wikipedia.org/wiki/Hotel).\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),(574,14,11,'WarrantyScope','WarrantyScope','A range of of services that will be provided to a customer free of charge in case of a defect or malfunction of a product.<br/><br/>\n\nCommonly used values:<br/><br/>\n\n<ul>\n<li>http://purl.org/goodrelations/v1#Labor-BringIn</li>\n<li>http://purl.org/goodrelations/v1#PartsAndLabor-BringIn</li>\n<li>http://purl.org/goodrelations/v1#PartsAndLabor-PickUp</li>\n</ul>\n'),(575,14,11,'TouristAttraction','TouristAttraction','A tourist attraction.  In principle any Thing can be a <a class=\"localLink\" href=\"http://schema.org/TouristAttraction\">TouristAttraction</a>, from a <a class=\"localLink\" href=\"http://schema.org/Mountain\">Mountain</a> and <a class=\"localLink\" href=\"http://schema.org/LandmarksOrHistoricalBuildings\">LandmarksOrHistoricalBuildings</a> to a <a class=\"localLink\" href=\"http://schema.org/LocalBusiness\">LocalBusiness</a>.  This Type can be used on its own to describe a general <a class=\"localLink\" href=\"http://schema.org/TouristAttraction\">TouristAttraction</a>, or be used as an <a class=\"localLink\" href=\"http://schema.org/additionalType\">additionalType</a> to add tourist attraction properties to any other type.  (See examples below)'),(576,14,11,'VideoGameSeries','VideoGameSeries','A video game series.'),(577,14,11,'FinancialProduct','FinancialProduct','A product provided to consumers and businesses by financial institutions such as banks, insurance companies, brokerage firms, consumer finance companies, and investment companies which comprise the financial services industry.'),(578,14,11,'MovieClip','MovieClip','A short segment/part of a movie.'),(579,14,11,'Thing','Thing','The most generic type of item.'),(580,14,11,'SteeringPositionValue','SteeringPositionValue','A value indicating a steering position.'),(581,14,11,'Synagogue','Synagogue','A synagogue.'),(582,14,11,'LiquorStore','LiquorStore','A shop that sells alcoholic drinks such as wine, beer, whisky and other spirits.'),(583,14,11,'OceanBodyOfWater','OceanBodyOfWater','An ocean (for example, the Pacific).'),(584,14,11,'TrainReservation','TrainReservation','A reservation for train travel.<br/><br/>\n\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, use <a class=\"localLink\" href=\"http://schema.org/Offer\">Offer</a>.'),(585,14,11,'BorrowAction','BorrowAction','The act of obtaining an object under an agreement to return it at a later date. Reciprocal of LendAction.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/LendAction\">LendAction</a>: Reciprocal of BorrowAction.</li>\n</ul>\n'),(586,14,11,'TechArticle','TechArticle','A technical article - Example: How-to (task) topics, step-by-step, procedural troubleshooting, specifications, etc.'),(587,14,11,'LoanOrCredit','LoanOrCredit','A financial product for the loaning of an amount of money under agreed terms and charges.'),(588,14,11,'DislikeAction','DislikeAction','The act of expressing a negative sentiment about the object. An agent dislikes an object (a proposition, topic or theme) with participants.'),(589,14,11,'ArriveAction','ArriveAction','The act of arriving at a place. An agent arrives at a destination from a fromLocation, optionally with participants.'),(590,14,11,'Campground','Campground','A camping site, campsite, or <a class=\"localLink\" href=\"http://schema.org/Campground\">Campground</a> is a place used for overnight stay in the outdoors, typically containing individual <a class=\"localLink\" href=\"http://schema.org/CampingPitch\">CampingPitch</a> locations. <br/><br/>\n\nIn British English a campsite is an area, usually divided into a number of pitches, where people can camp overnight using tents or camper vans or caravans; this British English use of the word is synonymous with the American English expression campground. In American English the term campsite generally means an area where an individual, family, group, or military unit can pitch a tent or park a camper; a campground may contain many campsites (Source: Wikipedia see <a href=\"https://en.wikipedia.org/wiki/Campsite\">https://en.wikipedia.org/wiki/Campsite</a>).<br/><br/>\n\nSee also the dedicated <a href=\"/docs/hotels.html\">document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),(591,14,11,'AutoRental','AutoRental','A car rental business.'),(592,14,11,'GolfCourse','GolfCourse','A golf course.'),(593,14,11,'Resort','Resort','A resort is a place used for relaxation or recreation, attracting visitors for holidays or vacations. Resorts are places, towns or sometimes commercial establishment operated by a single company (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Resort\">http://en.wikipedia.org/wiki/Resort</a>).\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),(594,14,11,'PaymentCard','PaymentCard','A payment method using a credit, debit, store or other card to associate the payment with an account.'),(595,14,11,'Float','Float','Data type: Floating number.'),(596,14,11,'Crematorium','Crematorium','A crematorium.'),(597,14,11,'ReplyAction','ReplyAction','The act of responding to a question/message asked/sent by the object. Related to <a class=\"localLink\" href=\"http://schema.org/AskAction\">AskAction</a><br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/AskAction\">AskAction</a>: Appears generally as an origin of a ReplyAction.</li>\n</ul>\n'),(598,14,11,'UserCheckins','UserCheckins','UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>-based vocabulary, alongside types such as <a class=\"localLink\" href=\"http://schema.org/Comment\">Comment</a>.'),(599,14,11,'BusStop','BusStop','A bus stop.'),(600,14,11,'CreditCard','CreditCard','A card payment method of a particular brand or name.  Used to mark up a particular payment method and/or the financial product/service that supplies the card account.<br/><br/>\n\nCommonly used values:<br/><br/>\n\n<ul>\n<li>http://purl.org/goodrelations/v1#AmericanExpress</li>\n<li>http://purl.org/goodrelations/v1#DinersClub</li>\n<li>http://purl.org/goodrelations/v1#Discover</li>\n<li>http://purl.org/goodrelations/v1#JCB</li>\n<li>http://purl.org/goodrelations/v1#MasterCard</li>\n<li>http://purl.org/goodrelations/v1#VISA</li>\n</ul>\n'),(601,14,11,'Waterfall','Waterfall','A waterfall, like Niagara.'),(602,14,11,'SuspendAction','SuspendAction','The act of momentarily pausing a device or application (e.g. pause music playback or pause a timer).'),(603,14,11,'TravelAgency','TravelAgency','A travel agency.'),(604,14,11,'BusinessFunction','BusinessFunction','The business function specifies the type of activity or access (i.e., the bundle of rights) offered by the organization or business person through the offer. Typical are sell, rental or lease, maintenance or repair, manufacture / produce, recycle / dispose, engineering / construction, or installation. Proprietary specifications of access rights are also instances of this class.<br/><br/>\n\nCommonly used values:<br/><br/>\n\n<ul>\n<li>http://purl.org/goodrelations/v1#ConstructionInstallation</li>\n<li>http://purl.org/goodrelations/v1#Dispose</li>\n<li>http://purl.org/goodrelations/v1#LeaseOut</li>\n<li>http://purl.org/goodrelations/v1#Maintain</li>\n<li>http://purl.org/goodrelations/v1#ProvideService</li>\n<li>http://purl.org/goodrelations/v1#Repair</li>\n<li>http://purl.org/goodrelations/v1#Sell</li>\n<li>http://purl.org/goodrelations/v1#Buy</li>\n</ul>\n'),(605,14,11,'MusicAlbumProductionType','MusicAlbumProductionType','Classification of the album by it\'s type of content: soundtrack, live album, studio album, etc.'),(606,14,11,'Library','Library','A library.'),(607,14,11,'GenderType','GenderType','An enumeration of genders.'),(608,14,11,'AutoWash','AutoWash','A car wash business.'),(609,14,11,'StadiumOrArena','StadiumOrArena','A stadium.'),(610,14,11,'FurnitureStore','FurnitureStore','A furniture store.'),(611,14,11,'CreateAction','CreateAction','The act of deliberately creating/producing/generating/building a result out of the agent.'),(612,14,11,'Service','Service','A service provided by an organization, e.g. delivery service, print services, etc.'),(613,14,11,'MusicPlaylist','MusicPlaylist','A collection of music tracks in playlist form.'),(614,14,11,'FilmAction','FilmAction','The act of capturing sound and moving images on film, video, or digitally.'),(615,14,11,'AccountingService','AccountingService','Accountancy business.<br/><br/>\n\nAs a <a class=\"localLink\" href=\"http://schema.org/LocalBusiness\">LocalBusiness</a> it can be described as a <a class=\"localLink\" href=\"http://schema.org/provider\">provider</a> of one or more <a class=\"localLink\" href=\"http://schema.org/Service\">Service</a>(s).'),(616,14,11,'Occupation','Occupation','A profession, may involve prolonged training and/or a formal qualification.'),(617,14,11,'VideoObject','VideoObject','A video file.'),(618,14,11,'EventStatusType','EventStatusType','EventStatusType is an enumeration type whose instances represent several states that an Event may be in.'),(619,14,11,'TennisComplex','TennisComplex','A tennis complex.'),(620,14,11,'DriveWheelConfigurationValue','DriveWheelConfigurationValue','A value indicating which roadwheels will receive torque.'),(621,14,11,'Distillery','Distillery','A distillery.'),(622,14,11,'InteractAction','InteractAction','The act of interacting with another person or organization.'),(623,14,11,'PriceSpecification','PriceSpecification','A structured value representing a price or price range. Typically, only the subclasses of this type are used for markup. It is recommended to use <a class=\"localLink\" href=\"http://schema.org/MonetaryAmount\">MonetaryAmount</a> to describe independent amounts of money such as a salary, credit card limits, etc.'),(624,14,11,'TypeAndQuantityNode','TypeAndQuantityNode','A structured value indicating the quantity, unit of measurement, and business function of goods included in a bundle offer.'),(625,14,11,'BedDetails','BedDetails','An entity holding detailed information about the available bed types, e.g. the quantity of twin beds for a hotel room. For the single case of just one bed of a certain type, you can use bed directly with a text. See also <a class=\"localLink\" href=\"http://schema.org/BedType\">BedType</a> (under development).'),(626,14,11,'Action','Action','An action performed by a direct agent and indirect participants upon a direct object. Optionally happens at a location with the help of an inanimate instrument. The execution of the action may produce a result. Specific action sub-type documentation specifies the exact expectation of each argument/role.<br/><br/>\n\nSee also <a href=\"http://blog.schema.org/2014/04/announcing-schemaorg-actions.html\">blog post</a> and <a href=\"http://schema.org/docs/actions.html\">Actions overview document</a>.'),(627,14,11,'CollectionPage','CollectionPage','Web page type: Collection page.'),(628,14,11,'Store','Store','A retail good store.'),(629,14,11,'Pond','Pond','A pond.'),(630,14,11,'LiveBlogPosting','LiveBlogPosting','A blog post intended to provide a rolling textual coverage of an ongoing event through continuous updates.'),(631,14,11,'QuantitativeValueDistribution','QuantitativeValueDistribution','A statistical distribution of values.'),(632,14,11,'GovernmentBuilding','GovernmentBuilding','A government building.'),(633,14,11,'JewelryStore','JewelryStore','A jewelry store.'),(634,14,11,'AskAction','AskAction','The act of posing a question / favor to someone.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/ReplyAction\">ReplyAction</a>: Appears generally as a response to AskAction.</li>\n</ul>\n'),(635,14,11,'TireShop','TireShop','A tire shop.'),(636,14,11,'Seat','Seat','Used to describe a seat, such as a reserved seat in an event reservation.'),(637,14,11,'FAQPage','FAQPage','A <a class=\"localLink\" href=\"http://schema.org/FAQPage\">FAQPage</a> is a <a class=\"localLink\" href=\"http://schema.org/WebPage\">WebPage</a> presenting one or more \"<a href=\"https://en.wikipedia.org/wiki/FAQ\">Frequently asked questions</a>\" (see also <a class=\"localLink\" href=\"http://schema.org/QAPage\">QAPage</a>).'),(638,14,11,'InviteAction','InviteAction','The act of asking someone to attend an event. Reciprocal of RsvpAction.'),(639,14,11,'OnDemandEvent','OnDemandEvent','A publication event e.g. catch-up TV or radio podcast, during which a program is available on-demand.'),(640,14,11,'AmusementPark','AmusementPark','An amusement park.'),(641,14,11,'ProgramMembership','ProgramMembership','Used to describe membership in a loyalty programs (e.g. \"StarAliance\"), traveler clubs (e.g. \"AAA\"), purchase clubs (\"Safeway Club\"), etc.'),(642,14,11,'ParcelService','ParcelService','A private parcel service as the delivery mode available for a certain offer.<br/><br/>\n\nCommonly used values:<br/><br/>\n\n<ul>\n<li>http://purl.org/goodrelations/v1#DHL</li>\n<li>http://purl.org/goodrelations/v1#FederalExpress</li>\n<li>http://purl.org/goodrelations/v1#UPS</li>\n</ul>\n'),(643,14,11,'EducationalOrganization','EducationalOrganization','An educational organization.'),(644,14,11,'DatedMoneySpecification','DatedMoneySpecification','A DatedMoneySpecification represents monetary values with optional start and end dates. For example, this could represent an employee\'s salary over a specific period of time. <strong>Note:</strong> This type has been superseded by <a class=\"localLink\" href=\"http://schema.org/MonetaryAmount\">MonetaryAmount</a> use of that type is recommended'),(645,14,11,'DanceEvent','DanceEvent','Event type: A social dance.'),(646,14,11,'AlignmentObject','AlignmentObject','An intangible item that describes an alignment between a learning resource and a node in an educational framework.'),(647,14,11,'NewsArticle','NewsArticle','A NewsArticle is an article whose content reports news, or provides background context and supporting materials for understanding the news.<br/><br/>\n\nA more detailed overview of <a href=\"/docs/news.html\">schema.org News markup</a> is also available.'),(648,14,11,'ServiceChannel','ServiceChannel','A means for accessing a service, e.g. a government office location, web site, or phone number.'),(649,14,11,'Bakery','Bakery','A bakery.'),(650,14,11,'SpreadsheetDigitalDocument','SpreadsheetDigitalDocument','A spreadsheet file.'),(651,14,11,'ComputerLanguage','ComputerLanguage','This type covers computer programming languages such as Scheme and Lisp, as well as other language-like computer representations. Natural languages are best represented with the <a class=\"localLink\" href=\"http://schema.org/Language\">Language</a> type.'),(652,14,11,'GeneralContractor','GeneralContractor','A general contractor.'),(653,14,11,'MarryAction','MarryAction','The act of marrying a person.'),(654,14,11,'Distance','Distance','Properties that take Distances as values are of the form \'&lt;Number&gt; &lt;Length unit of measure&gt;\'. E.g., \'7 ft\'.'),(655,14,11,'PreOrderAction','PreOrderAction','An agent orders a (not yet released) object/product/service to be delivered/sent.'),(656,14,11,'PlanAction','PlanAction','The act of planning the execution of an event/task/action/reservation/plan to a future date.'),(657,14,11,'PresentationDigitalDocument','PresentationDigitalDocument','A file containing slides or used for a presentation.'),(658,14,11,'MiddleSchool','MiddleSchool','A middle school (typically for children aged around 11-14, although this varies somewhat).'),(659,14,11,'BusTrip','BusTrip','A trip on a commercial bus line.'),(660,14,11,'HowToTool','HowToTool','A tool used (but not consumed) when performing instructions for how to achieve a result.'),(661,14,11,'ReplaceAction','ReplaceAction','The act of editing a recipient by replacing an old object with a new object.'),(662,14,11,'BankAccount','BankAccount','A product or service offered by a bank whereby one may deposit, withdraw or transfer money and in some cases be paid interest.'),(663,14,11,'ItemList','ItemList','A list of items of any sort&#x2014;for example, Top 10 Movies About Weathermen, or Top 100 Party Songs. Not to be confused with HTML lists, which are often used only for formatting.'),(664,14,11,'PostOffice','PostOffice','A post office.'),(665,14,11,'BikeStore','BikeStore','A bike store.'),(666,14,11,'ScholarlyArticle','ScholarlyArticle','A scholarly article.'),(667,14,11,'HomeAndConstructionBusiness','HomeAndConstructionBusiness','A construction business.<br/><br/>\n\nA HomeAndConstructionBusiness is a <a class=\"localLink\" href=\"http://schema.org/LocalBusiness\">LocalBusiness</a> that provides services around homes and buildings.<br/><br/>\n\nAs a <a class=\"localLink\" href=\"http://schema.org/LocalBusiness\">LocalBusiness</a> it can be described as a <a class=\"localLink\" href=\"http://schema.org/provider\">provider</a> of one or more <a class=\"localLink\" href=\"http://schema.org/Service\">Service</a>(s).'),(668,14,11,'DrinkAction','DrinkAction','The act of swallowing liquids.'),(669,14,11,'ComputerStore','ComputerStore','A computer store.'),(670,14,11,'Order','Order','An order is a confirmation of a transaction (a receipt), which can contain multiple line items, each represented by an Offer that has been accepted by the customer.'),(671,14,11,'RealEstateAgent','RealEstateAgent','A real-estate agent.'),(672,14,11,'BookFormatType','BookFormatType','The publication format of the book.'),(673,14,11,'SkiResort','SkiResort','A ski resort.'),(674,14,11,'Permit','Permit','A permit issued by an organization, e.g. a parking pass.'),(675,14,11,'APIReference','APIReference','Reference documentation for application programming interfaces (APIs).'),(676,14,11,'MovieRentalStore','MovieRentalStore','A movie rental store.'),(677,14,11,'TattooParlor','TattooParlor','A tattoo parlor.'),(678,14,11,'Audience','Audience','Intended audience for an item, i.e. the group for whom the item was created.'),(679,14,11,'PostalAddress','PostalAddress','The mailing address.'),(680,14,11,'WorkersUnion','WorkersUnion','A Workers Union (also known as a Labor Union, Labour Union, or Trade Union) is an organization that promotes the interests of its worker members by collectively bargaining with management, organizing, and political lobbying.'),(681,14,11,'LockerDelivery','LockerDelivery','A DeliveryMethod in which an item is made available via locker.'),(682,14,11,'ExerciseGym','ExerciseGym','A gym.'),(683,14,11,'RadioSeason','RadioSeason','Season dedicated to radio broadcast and associated online delivery.'),(684,14,11,'GasStation','GasStation','A gas station.'),(685,14,11,'WholesaleStore','WholesaleStore','A wholesale store.'),(686,14,11,'NailSalon','NailSalon','A nail salon.'),(687,14,11,'Pharmacy','Pharmacy','A pharmacy or drugstore.'),(688,14,11,'Reservation','Reservation','Describes a reservation for travel, dining or an event. Some reservations require tickets. <br/><br/>\n\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, restaurant reservations, flights, or rental cars, use <a class=\"localLink\" href=\"http://schema.org/Offer\">Offer</a>.'),(689,14,11,'UserBlocks','UserBlocks','UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>-based vocabulary, alongside types such as <a class=\"localLink\" href=\"http://schema.org/Comment\">Comment</a>.'),(690,14,11,'SeaBodyOfWater','SeaBodyOfWater','A sea (for example, the Caspian sea).'),(691,14,11,'OrganizeAction','OrganizeAction','The act of manipulating/administering/supervising/controlling one or more objects.'),(692,14,11,'Menu','Menu','A structured representation of food or drink items available from a FoodEstablishment.'),(693,14,11,'ElementarySchool','ElementarySchool','An elementary school.'),(694,14,11,'SportsTeam','SportsTeam','Organization: Sports team.'),(695,14,11,'ExerciseAction','ExerciseAction','The act of participating in exertive activity for the purposes of improving health and fitness.'),(696,14,11,'ItemPage','ItemPage','A page devoted to a single item, such as a particular product or hotel.'),(697,14,11,'SportingGoodsStore','SportingGoodsStore','A sporting goods store.'),(698,14,11,'DisagreeAction','DisagreeAction','The act of expressing a difference of opinion with the object. An agent disagrees to/about an object (a proposition, topic or theme) with participants.'),(699,14,11,'MusicRelease','MusicRelease','A MusicRelease is a specific release of a music album.'),(700,14,11,'FlightReservation','FlightReservation','A reservation for air travel.<br/><br/>\n\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, use <a class=\"localLink\" href=\"http://schema.org/Offer\">Offer</a>.'),(701,14,11,'StructuredValue','StructuredValue','Structured values are used when the value of a property has a more complex structure than simply being a textual value or a reference to another thing.'),(702,14,11,'Quantity','Quantity','Quantities such as distance, time, mass, weight, etc. Particular instances of say Mass are entities like \'3 Kg\' or \'4 milligrams\'.'),(703,14,11,'AutomatedTeller','AutomatedTeller','ATM/cash machine.'),(704,14,11,'WatchAction','WatchAction','The act of consuming dynamic/moving visual content.'),(705,14,11,'MonetaryAmount','MonetaryAmount','A monetary value or range. This type can be used to describe an amount of money such as $50 USD, or a range as in describing a bank account being suitable for a balance between £1,000 and £1,000,000 GBP, or the value of a salary, etc. It is recommended to use <a class=\"localLink\" href=\"http://schema.org/PriceSpecification\">PriceSpecification</a> Types to describe the price of an Offer, Invoice, etc.'),(706,14,11,'DonateAction','DonateAction','The act of providing goods, services, or money without compensation, often for philanthropic reasons.'),(707,14,11,'VisualArtsEvent','VisualArtsEvent','Event type: Visual arts event.'),(708,14,11,'AuthorizeAction','AuthorizeAction','The act of granting permission to an object.'),(709,14,11,'TravelAction','TravelAction','The act of traveling from an fromLocation to a destination by a specified mode of transport, optionally with participants.'),(710,14,11,'PaymentChargeSpecification','PaymentChargeSpecification','The costs of settling the payment using a particular payment method.'),(711,14,11,'Suite','Suite','A suite in a hotel or other public accommodation, denotes a class of luxury accommodations, the key feature of which is multiple rooms (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Suite_(hotel)\">http://en.wikipedia.org/wiki/Suite_(hotel)</a>).\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),(712,14,11,'Photograph','Photograph','A photograph.'),(713,14,11,'Role','Role','Represents additional information about a relationship or property. For example a Role can be used to say that a \'member\' role linking some SportsTeam to a player occurred during a particular time period. Or that a Person\'s \'actor\' role in a Movie was for some particular characterName. Such properties can be attached to a Role entity, which is then associated with the main entities using ordinary properties like \'member\' or \'actor\'.<br/><br/>\n\nSee also <a href=\"http://blog.schema.org/2014/06/introducing-role.html\">blog post</a>.'),(714,14,11,'AboutPage','AboutPage','Web page type: About page.'),(715,14,11,'DeactivateAction','DeactivateAction','The act of stopping or deactivating a device or application (e.g. stopping a timer or turning off a flashlight).'),(716,14,11,'OfferItemCondition','OfferItemCondition','A list of possible conditions for the item.'),(717,14,11,'PerformAction','PerformAction','The act of participating in performance arts.'),(718,14,11,'CancelAction','CancelAction','The act of asserting that a future event/action is no longer going to happen.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/ConfirmAction\">ConfirmAction</a>: The antonym of CancelAction.</li>\n</ul>\n'),(719,14,11,'AdultEntertainment','AdultEntertainment','An adult entertainment establishment.'),(720,14,11,'Enumeration','Enumeration','Lists or enumerationsófor example, a list of cuisines or music genres, etc.'),(721,14,11,'MobilePhoneStore','MobilePhoneStore','A store that sells mobile phones and related accessories.'),(722,14,11,'Demand','Demand','A demand entity represents the public, not necessarily binding, not necessarily exclusive, announcement by an organization or person to seek a certain type of goods or services. For describing demand using this type, the very same properties used for Offer apply.'),(723,14,11,'SoftwareSourceCode','SoftwareSourceCode','Computer programming source code. Example: Full (compile ready) solutions, code snippet samples, scripts, templates.'),(724,14,11,'MusicVenue','MusicVenue','A music venue.'),(725,14,11,'MeetingRoom','MeetingRoom','A meeting room, conference room, or conference hall is a room provided for singular events such as business conferences and meetings (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Conference_hall\">http://en.wikipedia.org/wiki/Conference_hall</a>).\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),(726,14,11,'Playground','Playground','A playground.'),(727,14,11,'ViewAction','ViewAction','The act of consuming static visual content.'),(728,14,11,'ResumeAction','ResumeAction','The act of resuming a device or application which was formerly paused (e.g. resume music playback or resume a timer).'),(729,14,11,'ReactAction','ReactAction','The act of responding instinctively and emotionally to an object, expressing a sentiment.'),(730,14,11,'Aquarium','Aquarium','Aquarium.'),(731,14,11,'DiscussionForumPosting','DiscussionForumPosting','A posting to a discussion forum.'),(732,14,11,'CheckoutPage','CheckoutPage','Web page type: Checkout page.'),(733,14,11,'BoardingPolicyType','BoardingPolicyType','A type of boarding policy used by an airline.'),(734,14,11,'AutomotiveBusiness','AutomotiveBusiness','Car repair, sales, or parts.'),(735,14,11,'DeleteAction','DeleteAction','The act of editing a recipient by removing one of its objects.'),(736,14,11,'EatAction','EatAction','The act of swallowing solid objects.'),(737,14,11,'AnimalShelter','AnimalShelter','Animal shelter.'),(738,14,11,'ShareAction','ShareAction','The act of distributing content to people for their amusement or edification.'),(739,14,11,'Continent','Continent','One of the continents (for example, Europe or Africa).'),(740,14,11,'UserInteraction','UserInteraction','UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>-based vocabulary, alongside types such as <a class=\"localLink\" href=\"http://schema.org/Comment\">Comment</a>.'),(741,14,11,'BusStation','BusStation','A bus station.'),(742,14,11,'EngineSpecification','EngineSpecification','Information about the engine of the vehicle. A vehicle can have multiple engines represented by multiple engine specification entities.'),(743,14,11,'Code','Code','Computer programming source code. Example: Full (compile ready) solutions, code snippet samples, scripts, templates.'),(744,14,11,'AddAction','AddAction','The act of editing by adding an object to a collection.'),(745,14,11,'TVClip','TVClip','A short TV program or a segment/part of a TV program.'),(746,14,11,'ActionAccessSpecification','ActionAccessSpecification','A set of requirements that a must be fulfilled in order to perform an Action.'),(747,14,11,'HotelRoom','HotelRoom','A hotel room is a single room in a hotel.\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),(748,14,11,'ReserveAction','ReserveAction','Reserving a concrete object.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/ScheduleAction\">ScheduleAction</a></a>: Unlike ScheduleAction, ReserveAction reserves concrete objects (e.g. a table, a hotel) towards a time slot / spatial allocation.</li>\n</ul>\n'),(749,14,11,'BusinessAudience','BusinessAudience','A set of characteristics belonging to businesses, e.g. who compose an item\'s target audience.'),(750,14,11,'Dentist','Dentist','A dentist.'),(751,14,11,'UnitPriceSpecification','UnitPriceSpecification','The price asked for a given offer by the respective organization or person.'),(752,14,11,'MenuItem','MenuItem','A food or drink item listed in a menu or menu section.'),(753,14,11,'MovieTheater','MovieTheater','A movie theater.'),(754,14,11,'Car','Car','A car is a wheeled, self-powered motor vehicle used for transportation.'),(755,14,11,'RadioStation','RadioStation','A radio station.'),(756,14,11,'MotorcycleDealer','MotorcycleDealer','A motorcycle dealer.'),(757,14,11,'Event','Event','An event happening at a certain time and location, such as a concert, lecture, or festival. Ticketing information may be added via the <a class=\"localLink\" href=\"http://schema.org/offers\">offers</a> property. Repeated events may be structured as separate Event objects.'),(758,14,11,'SocialMediaPosting','SocialMediaPosting','A post to a social media platform, including blog posts, tweets, Facebook posts, etc.'),(759,14,11,'Sculpture','Sculpture','A piece of sculpture.'),(760,14,11,'CreativeWorkSeason','CreativeWorkSeason','A media season e.g. tv, radio, video game etc.'),(761,14,11,'CatholicChurch','CatholicChurch','A Catholic church.'),(762,14,11,'OfferCatalog','OfferCatalog','An OfferCatalog is an ItemList that contains related Offers and/or further OfferCatalogs that are offeredBy the same provider.'),(763,14,11,'HairSalon','HairSalon','A hair salon.'),(764,14,11,'RsvpAction','RsvpAction','The act of notifying an event organizer as to whether you expect to attend the event.'),(765,14,11,'URL','URL','Data type: URL.'),(766,14,11,'Accommodation','Accommodation','An accommodation is a place that can accommodate human beings, e.g. a hotel room, a camping pitch, or a meeting room. Many accommodations are for overnight stays, but this is not a mandatory requirement.\nFor more specific types of accommodations not defined in schema.org, one can use additionalType with external vocabularies.\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),(767,14,11,'VideoGameClip','VideoGameClip','A short segment/part of a video game.'),(768,14,11,'LocalBusiness','LocalBusiness','A particular physical business or branch of an organization. Examples of LocalBusiness include a restaurant, a particular branch of a restaurant chain, a branch of a bank, a medical practice, a club, a bowling alley, etc.'),(769,14,11,'TVEpisode','TVEpisode','A TV episode which can be part of a series or season.'),(770,14,11,'Residence','Residence','The place where a person lives.'),(771,14,11,'DataFeed','DataFeed','A single feed providing structured information about one or more entities or topics.'),(772,14,11,'CompoundPriceSpecification','CompoundPriceSpecification','A compound price specification is one that bundles multiple prices that all apply in combination for different dimensions of consumption. Use the name property of the attached unit price specification for indicating the dimension of a price component (e.g. \"electricity\" or \"final cleaning\").'),(773,14,11,'BodyOfWater','BodyOfWater','A body of water, such as a sea, ocean, or lake.'),(774,14,11,'BookmarkAction','BookmarkAction','An agent bookmarks/flags/labels/tags/marks an object.'),(775,14,11,'Specialty','Specialty','Any branch of a field in which people typically develop specific expertise, usually after significant study, time, and effort.'),(776,14,11,'Comment','Comment','A comment on an item - for example, a comment on a blog post. The comment\'s content is expressed via the <a class=\"localLink\" href=\"http://schema.org/text\">text</a> property, and its topic via <a class=\"localLink\" href=\"http://schema.org/about\">about</a>, properties shared with all CreativeWorks.'),(777,14,11,'AppendAction','AppendAction','The act of inserting at the end if an ordered collection.'),(778,14,11,'DataCatalog','DataCatalog','A collection of datasets.'),(779,14,11,'Reservoir','Reservoir','A reservoir of water, typically an artificially created lake, like the Lake Kariba reservoir.'),(780,14,11,'DepartAction','DepartAction','The act of  departing from a place. An agent departs from an fromLocation for a destination, optionally with participants.'),(781,14,11,'MediaSubscription','MediaSubscription','A subscription which allows a user to access media including audio, video, books, etc.'),(782,14,11,'DrawAction','DrawAction','The act of producing a visual/graphical representation of an object, typically with a pen/pencil and paper as instruments.'),(783,14,11,'Attorney','Attorney','Professional service: Attorney. <br/><br/>\n\nThis type is deprecated - <a class=\"localLink\" href=\"http://schema.org/LegalService\">LegalService</a> is more inclusive and less ambiguous.'),(784,14,11,'LiteraryEvent','LiteraryEvent','Event type: Literary event.'),(785,14,11,'ApartmentComplex','ApartmentComplex','Residence type: Apartment complex.'),(786,14,11,'FMRadioChannel','FMRadioChannel','A radio channel that uses FM.'),(787,14,11,'PublicSwimmingPool','PublicSwimmingPool','A public swimming pool.'),(788,14,11,'WPFooter','WPFooter','The footer section of the page.'),(789,14,11,'InstallAction','InstallAction','The act of installing an application.'),(790,14,11,'OrderAction','OrderAction','An agent orders an object/product/service to be delivered/sent.'),(791,14,11,'HVACBusiness','HVACBusiness','A business that provide Heating, Ventilation and Air Conditioning services.'),(792,14,11,'HowToDirection','HowToDirection','A direction indicating a single action to do in the instructions for how to achieve a result.'),(793,14,11,'Game','Game','The Game type represents things which are games. These are typically rule-governed recreational activities, e.g. role-playing games in which players assume the role of characters in a fictional setting.'),(794,14,11,'OpeningHoursSpecification','OpeningHoursSpecification','A structured value providing information about the opening hours of a place or a certain service inside a place.<br/><br/>\n\nThe place is <strong>open</strong> if the <a class=\"localLink\" href=\"http://schema.org/opens\">opens</a> property is specified, and <strong>closed</strong> otherwise.<br/><br/>\n\nIf the value for the <a class=\"localLink\" href=\"http://schema.org/closes\">closes</a> property is less than the value for the <a class=\"localLink\" href=\"http://schema.org/opens\">opens</a> property then the hour range is assumed to span over the next day.'),(795,14,11,'Barcode','Barcode','An image of a visual machine-readable code such as a barcode or QR code.'),(796,14,11,'WPAdBlock','WPAdBlock','An advertising section of the page.'),(797,14,11,'BedAndBreakfast','BedAndBreakfast','Bed and breakfast.\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),(798,14,11,'CheckAction','CheckAction','An agent inspects, determines, investigates, inquires, or examines an object\'s accuracy, quality, condition, or state.'),(799,14,11,'SelfStorage','SelfStorage','A self-storage facility.'),(800,14,11,'Museum','Museum','A museum.'),(801,14,11,'DeliveryChargeSpecification','DeliveryChargeSpecification','The price for the delivery of an offer using a particular delivery method.'),(802,14,11,'UserTweets','UserTweets','UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>-based vocabulary, alongside types such as <a class=\"localLink\" href=\"http://schema.org/Comment\">Comment</a>.'),(803,14,11,'DryCleaningOrLaundry','DryCleaningOrLaundry','A dry-cleaning business.'),(804,14,11,'RecyclingCenter','RecyclingCenter','A recycling center.'),(805,14,11,'OrderItem','OrderItem','An order item is a line of an order. It includes the quantity and shipping details of a bought offer.'),(806,14,11,'Mosque','Mosque','A mosque.'),(807,14,11,'TakeAction','TakeAction','The act of gaining ownership of an object from an origin. Reciprocal of GiveAction.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/GiveAction\">GiveAction</a>: The reciprocal of TakeAction.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/ReceiveAction\">ReceiveAction</a>: Unlike ReceiveAction, TakeAction implies that ownership has been transfered.</li>\n</ul>\n'),(808,14,11,'BroadcastService','BroadcastService','A delivery service through which content is provided via broadcast over the air or online.'),(809,14,11,'Bridge','Bridge','A bridge.'),(810,14,11,'ActionStatusType','ActionStatusType','The status of an Action.'),(811,14,11,'SpeakableSpecification','SpeakableSpecification','A SpeakableSpecification indicates (typically via <a class=\"localLink\" href=\"http://schema.org/xpath\">xpath</a> or <a class=\"localLink\" href=\"http://schema.org/cssSelector\">cssSelector</a>) sections of a document that are highlighted as particularly <a class=\"localLink\" href=\"http://schema.org/speakable\">speakable</a>. Instances of this type are expected to be used primarily as values of the <a class=\"localLink\" href=\"http://schema.org/speakable\">speakable</a> property.'),(812,14,11,'CreativeWork','CreativeWork','The most generic kind of creative work, including books, movies, photographs, software programs, etc.'),(813,14,11,'RadioChannel','RadioChannel','A unique instance of a radio BroadcastService on a CableOrSatelliteService lineup.'),(814,14,11,'PetStore','PetStore','A pet store.'),(815,14,11,'DepartmentStore','DepartmentStore','A department store.'),(816,14,11,'ReturnAction','ReturnAction','The act of returning to the origin that which was previously received (concrete objects) or taken (ownership).'),(817,14,11,'Physician','Physician','A doctor\'s office.'),(818,14,11,'Notary','Notary','A notary.'),(819,14,11,'MobileApplication','MobileApplication','A software application designed specifically to work well on a mobile device such as a telephone.'),(820,14,11,'WebPage','WebPage','A web page. Every web page is implicitly assumed to be declared to be of type WebPage, so the various properties about that webpage, such as <code>breadcrumb</code> may be used. We recommend explicit declaration if these properties are specified, but if they are found outside of an itemscope, they will be assumed to be about the page.'),(821,14,11,'SportsClub','SportsClub','A sports club.'),(822,14,11,'Place','Place','Entities that have a somewhat fixed, physical extension.'),(823,14,11,'OrganizationRole','OrganizationRole','A subclass of Role used to describe roles within organizations.'),(824,14,11,'CivicStructure','CivicStructure','A public structure, such as a town hall or concert hall.'),(825,14,11,'ProfilePage','ProfilePage','Web page type: Profile page.'),(826,14,11,'Article','Article','An article, such as a news article or piece of investigative report. Newspapers and magazines have articles of many different types and this is intended to cover them all.<br/><br/>\n\nSee also <a href=\"http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html\">blog post</a>.'),(827,14,11,'NGO','NGO','Organization: Non-governmental Organization.'),(828,14,11,'AutoDealer','AutoDealer','An car dealership.'),(829,14,11,'ControlAction','ControlAction','An agent controls a device or application.'),(830,14,11,'ContactPointOption','ContactPointOption','Enumerated options related to a ContactPoint.'),(831,14,11,'LoseAction','LoseAction','The act of being defeated in a competitive activity.'),(832,14,11,'Plumber','Plumber','A plumbing service.'),(833,14,11,'IceCreamShop','IceCreamShop','An ice cream shop.'),(834,14,11,'GeoShape','GeoShape','The geographic shape of a place. A GeoShape can be described using several properties whose values are based on latitude/longitude pairs. Either whitespace or commas can be used to separate latitude and longitude; whitespace should be used when writing a list of several such points.'),(835,14,11,'RejectAction','RejectAction','The act of rejecting to/adopting an object.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/AcceptAction\">AcceptAction</a>: The antonym of RejectAction.</li>\n</ul>\n'),(836,14,11,'PublicationVolume','PublicationVolume','A part of a successively published publication such as a periodical or multi-volume work, often numbered. It may represent a time span, such as a year.<br/><br/>\n\nSee also <a href=\"http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html\">blog post</a>.'),(837,14,11,'OfficeEquipmentStore','OfficeEquipmentStore','An office equipment store.'),(838,14,11,'ChildrensEvent','ChildrensEvent','Event type: Children\'s event.'),(839,14,11,'MovieSeries','MovieSeries','A series of movies. Included movies can be indicated with the hasPart property.'),(840,14,11,'CheckInAction','CheckInAction','The act of an agent communicating (service provider, social media, etc) their arrival by registering/confirming for a previously reserved service (e.g. flight check in) or at a place (e.g. hotel), possibly resulting in a result (boarding pass, etc).<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/CheckOutAction\">CheckOutAction</a>: The antonym of CheckInAction.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/ArriveAction\">ArriveAction</a>: Unlike ArriveAction, CheckInAction implies that the agent is informing/confirming the start of a previously reserved service.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/ConfirmAction\">ConfirmAction</a>: Unlike ConfirmAction, CheckInAction implies that the agent is informing/confirming the <em>start</em> of a previously reserved service rather than its validity/existence.</li>\n</ul>\n'),(841,14,11,'MusicGroup','MusicGroup','A musical group, such as a band, an orchestra, or a choir. Can also be a solo musician.'),(842,14,11,'GatedResidenceCommunity','GatedResidenceCommunity','Residence type: Gated community.'),(843,14,11,'QuoteAction','QuoteAction','An agent quotes/estimates/appraises an object/product/service with a price at a location/store.'),(844,14,11,'Ticket','Ticket','Used to describe a ticket to an event, a flight, a bus ride, etc.'),(845,14,11,'PlayAction','PlayAction','The act of playing/exercising/training/performing for enjoyment, leisure, recreation, Competition or exercise.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/ListenAction\">ListenAction</a>: Unlike ListenAction (which is under ConsumeAction), PlayAction refers to performing for an audience or at an event, rather than consuming music.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/WatchAction\">WatchAction</a>: Unlike WatchAction (which is under ConsumeAction), PlayAction refers to showing/displaying for an audience or at an event, rather than consuming visual content.</li>\n</ul>\n'),(846,14,11,'CommunicateAction','CommunicateAction','The act of conveying information to another person via a communication medium (instrument) such as speech, email, or telephone conversation.'),(847,14,11,'DigitalDocument','DigitalDocument','An electronic file or document.'),(848,14,11,'PerformingArtsTheater','PerformingArtsTheater','A theater or other performing art center.'),(849,14,11,'FastFoodRestaurant','FastFoodRestaurant','A fast-food restaurant.'),(850,14,11,'Language','Language','Natural languages such as Spanish, Tamil, Hindi, English, etc. Formal language code tags expressed in <a href=\"https://en.wikipedia.org/wiki/IETF_language_tag\">BCP 47</a> can be used via the <a class=\"localLink\" href=\"http://schema.org/alternateName\">alternateName</a> property. The Language type previously also covered programming languages such as Scheme and Lisp, which are now best represented using <a class=\"localLink\" href=\"http://schema.org/ComputerLanguage\">ComputerLanguage</a>.'),(851,14,11,'NoteDigitalDocument','NoteDigitalDocument','A file containing a note, primarily for the author.'),(852,14,11,'SomeProducts','SomeProducts','A placeholder for multiple similar products of the same kind.'),(853,14,11,'LikeAction','LikeAction','The act of expressing a positive sentiment about the object. An agent likes an object (a proposition, topic or theme) with participants.'),(854,14,11,'PerformanceRole','PerformanceRole','A PerformanceRole is a Role that some entity places with regard to a theatrical performance, e.g. in a Movie, TVSeries etc.'),(855,14,11,'MonetaryAmountDistribution','MonetaryAmountDistribution','A statistical distribution of monetary amounts.'),(856,14,11,'ReceiveAction','ReceiveAction','The act of physically/electronically taking delivery of an object thathas been transferred from an origin to a destination. Reciprocal of SendAction.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/SendAction\">SendAction</a>: The reciprocal of ReceiveAction.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/TakeAction\">TakeAction</a>: Unlike TakeAction, ReceiveAction does not imply that the ownership has been transfered (e.g. I can receive a package, but it does not mean the package is now mine).</li>\n</ul>\n'),(857,14,11,'BroadcastEvent','BroadcastEvent','An over the air or online broadcast event.'),(858,14,11,'PeopleAudience','PeopleAudience','A set of characteristics belonging to people, e.g. who compose an item\'s target audience.'),(859,14,11,'Park','Park','A park.'),(860,14,11,'ConvenienceStore','ConvenienceStore','A convenience store.'),(861,14,11,'Airport','Airport','An airport.'),(862,14,11,'ActivateAction','ActivateAction','The act of starting or activating a device or application (e.g. starting a timer or turning on a flashlight).'),(863,14,11,'GamePlayMode','GamePlayMode','Indicates whether this game is multi-player, co-op or single-player.'),(864,14,11,'InteractionCounter','InteractionCounter','A summary of how users have interacted with this CreativeWork. In most cases, authors will use a subtype to specify the specific type of interaction.'),(865,14,11,'EventReservation','EventReservation','A reservation for an event like a concert, sporting event, or lecture.<br/><br/>\n\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, use <a class=\"localLink\" href=\"http://schema.org/Offer\">Offer</a>.'),(866,14,11,'DiscoverAction','DiscoverAction','The act of discovering/finding an object.'),(867,14,11,'ProfessionalService','ProfessionalService','Original definition: \"provider of professional services.\"<br/><br/>\n\nThe general <a class=\"localLink\" href=\"http://schema.org/ProfessionalService\">ProfessionalService</a> type for local businesses was deprecated due to confusion with <a class=\"localLink\" href=\"http://schema.org/Service\">Service</a>. For reference, the types that it included were: <a class=\"localLink\" href=\"http://schema.org/Dentist\">Dentist</a>,\n        <a class=\"localLink\" href=\"http://schema.org/AccountingService\">AccountingService</a>, <a class=\"localLink\" href=\"http://schema.org/Attorney\">Attorney</a>, <a class=\"localLink\" href=\"http://schema.org/Notary\">Notary</a>, as well as types for several kinds of <a class=\"localLink\" href=\"http://schema.org/HomeAndConstructionBusiness\">HomeAndConstructionBusiness</a>: <a class=\"localLink\" href=\"http://schema.org/Electrician\">Electrician</a>, <a class=\"localLink\" href=\"http://schema.org/GeneralContractor\">GeneralContractor</a>,\n        <a class=\"localLink\" href=\"http://schema.org/HousePainter\">HousePainter</a>, <a class=\"localLink\" href=\"http://schema.org/Locksmith\">Locksmith</a>, <a class=\"localLink\" href=\"http://schema.org/Plumber\">Plumber</a>, <a class=\"localLink\" href=\"http://schema.org/RoofingContractor\">RoofingContractor</a>. <a class=\"localLink\" href=\"http://schema.org/LegalService\">LegalService</a> was introduced as a more inclusive supertype of <a class=\"localLink\" href=\"http://schema.org/Attorney\">Attorney</a>.'),(868,14,11,'Integer','Integer','Data type: Integer.'),(869,14,11,'LendAction','LendAction','The act of providing an object under an agreement that it will be returned at a later date. Reciprocal of BorrowAction.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/BorrowAction\">BorrowAction</a>: Reciprocal of LendAction.</li>\n</ul>\n'),(870,14,11,'AudioObject','AudioObject','An audio file.'),(871,14,11,'BeautySalon','BeautySalon','Beauty salon.'),(872,14,11,'Recipe','Recipe','A recipe. For dietary restrictions covered by the recipe, a few common restrictions are enumerated via <a class=\"localLink\" href=\"http://schema.org/suitableForDiet\">suitableForDiet</a>. The <a class=\"localLink\" href=\"http://schema.org/keywords\">keywords</a> property can also be used to add more detail.'),(873,14,11,'Motel','Motel','A motel.\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),(874,14,11,'CookAction','CookAction','The act of producing/preparing food.'),(875,14,11,'Volcano','Volcano','A volcano, like Fuji san.'),(876,14,11,'SendAction','SendAction','The act of physically/electronically dispatching an object for transfer from an origin to a destination.Related actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/ReceiveAction\">ReceiveAction</a>: The reciprocal of SendAction.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/GiveAction\">GiveAction</a>: Unlike GiveAction, SendAction does not imply the transfer of ownership (e.g. I can send you my laptop, but I\'m not necessarily giving it to you).</li>\n</ul>\n'),(877,14,11,'InformAction','InformAction','The act of notifying someone of information pertinent to them, with no expectation of a response.'),(878,14,11,'PropertyValueSpecification','PropertyValueSpecification','A Property value specification.'),(879,14,11,'PerformingGroup','PerformingGroup','A performance group, such as a band, an orchestra, or a circus.'),(880,14,11,'Episode','Episode','A media episode (e.g. TV, radio, video game) which can be part of a series or season.'),(881,14,11,'HowToTip','HowToTip','An explanation in the instructions for how to achieve a result. It provides supplementary information about a technique, supply, author\'s preference, etc. It can explain what could be done, or what should not be done, but doesn\'t specify what should be done (see HowToDirection).'),(882,14,11,'SoftwareApplication','SoftwareApplication','A software application.'),(883,14,11,'SiteNavigationElement','SiteNavigationElement','A navigation element of the page.'),(884,14,11,'UnRegisterAction','UnRegisterAction','The act of un-registering from a service.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/RegisterAction\">RegisterAction</a>: antonym of UnRegisterAction.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/LeaveAction\">LeaveAction</a>: Unlike LeaveAction, UnRegisterAction implies that you are unregistering from a service you werer previously registered, rather than leaving a team/group of people.</li>\n</ul>\n'),(885,14,11,'HardwareStore','HardwareStore','A hardware store.'),(886,14,11,'ImageGallery','ImageGallery','Web page type: Image gallery page.'),(887,14,11,'BuddhistTemple','BuddhistTemple','A Buddhist temple.'),(888,14,11,'UserDownloads','UserDownloads','UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>-based vocabulary, alongside types such as <a class=\"localLink\" href=\"http://schema.org/Comment\">Comment</a>.'),(889,14,11,'Season','Season','A media season e.g. tv, radio, video game etc.'),(890,14,11,'LeaveAction','LeaveAction','An agent leaves an event / group with participants/friends at a location.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/JoinAction\">JoinAction</a>: The antonym of LeaveAction.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/UnRegisterAction\">UnRegisterAction</a>: Unlike UnRegisterAction, LeaveAction implies leaving a group/team of people rather than a service.</li>\n</ul>\n'),(891,14,11,'Movie','Movie','A movie.'),(892,14,11,'GovernmentOrganization','GovernmentOrganization','A governmental organization or agency.'),(893,14,11,'EmployerAggregateRating','EmployerAggregateRating','An aggregate rating of an Organization related to its role as an employer.'),(894,14,11,'SearchResultsPage','SearchResultsPage','Web page type: Search results page.'),(895,14,11,'VoteAction','VoteAction','The act of expressing a preference from a fixed/finite/structured set of choices/options.'),(896,14,11,'AcceptAction','AcceptAction','The act of committing to/adopting an object.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/RejectAction\">RejectAction</a>: The antonym of AcceptAction.</li>\n</ul>\n'),(897,14,11,'AssessAction','AssessAction','The act of forming one\'s opinion, reaction or sentiment.'),(898,14,11,'GovernmentService','GovernmentService','A service provided by a government organization, e.g. food stamps, veterans benefits, etc.'),(899,14,11,'ItemAvailability','ItemAvailability','A list of possible product availability options.'),(900,14,11,'State','State','A state or province of a country.'),(901,14,11,'Person','Person','A person (alive, dead, undead, or fictional).'),(902,14,11,'CheckOutAction','CheckOutAction','The act of an agent communicating (service provider, social media, etc) their departure of a previously reserved service (e.g. flight check in) or place (e.g. hotel).<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/CheckInAction\">CheckInAction</a>: The antonym of CheckOutAction.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/DepartAction\">DepartAction</a>: Unlike DepartAction, CheckOutAction implies that the agent is informing/confirming the end of a previously reserved service.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/CancelAction\">CancelAction</a>: Unlike CancelAction, CheckOutAction implies that the agent is informing/confirming the end of a previously reserved service.</li>\n</ul>\n'),(903,14,11,'SubscribeAction','SubscribeAction','The act of forming a personal connection with someone/something (object) unidirectionally/asymmetrically to get updates pushed to.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/FollowAction\">FollowAction</a>: Unlike FollowAction, SubscribeAction implies that the subscriber acts as a passive agent being constantly/actively pushed for updates.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/RegisterAction\">RegisterAction</a>: Unlike RegisterAction, SubscribeAction implies that the agent is interested in continuing receiving updates from the object.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/JoinAction\">JoinAction</a>: Unlike JoinAction, SubscribeAction implies that the agent is interested in continuing receiving updates from the object.</li>\n</ul>\n'),(904,14,11,'SellAction','SellAction','The act of taking money from a buyer in exchange for goods or services rendered. An agent sells an object, product, or service to a buyer for a price. Reciprocal of BuyAction.'),(905,14,11,'Courthouse','Courthouse','A courthouse.'),(906,14,11,'ContactPage','ContactPage','Web page type: Contact page.'),(907,14,11,'OutletStore','OutletStore','An outlet store.'),(908,14,11,'OrderStatus','OrderStatus','Enumerated status values for Order.'),(909,14,11,'CollegeOrUniversity','CollegeOrUniversity','A college, university, or other third-level educational institution.'),(910,14,11,'TrackAction','TrackAction','An agent tracks an object for updates.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/FollowAction\">FollowAction</a>: Unlike FollowAction, TrackAction refers to the interest on the location of innanimates objects.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/SubscribeAction\">SubscribeAction</a>: Unlike SubscribeAction, TrackAction refers to  the interest on the location of innanimate objects.</li>\n</ul>\n'),(911,14,11,'UpdateAction','UpdateAction','The act of managing by changing/editing the state of the object.'),(912,14,11,'Invoice','Invoice','A statement of the money due for goods or services; a bill.'),(913,14,11,'BookStore','BookStore','A bookstore.'),(914,14,11,'SocialEvent','SocialEvent','Event type: Social event.'),(915,14,11,'WinAction','WinAction','The act of achieving victory in a competitive activity.'),(916,14,11,'VisualArtwork','VisualArtwork','A work of art that is primarily visual in character.'),(917,14,11,'ShoppingCenter','ShoppingCenter','A shopping center or mall.'),(918,14,11,'SearchAction','SearchAction','The act of searching for an object.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/FindAction\">FindAction</a>: SearchAction generally leads to a FindAction, but not necessarily.</li>\n</ul>\n'),(919,14,11,'AssignAction','AssignAction','The act of allocating an action/event/task to some destination (someone or something).'),(920,14,11,'EmergencyService','EmergencyService','An emergency service, such as a fire station or ER.'),(921,14,11,'GroceryStore','GroceryStore','A grocery store.'),(922,14,11,'Report','Report','A Report generated by governmental or non-governmental organization.'),(923,14,11,'ConfirmAction','ConfirmAction','The act of notifying someone that a future event/action is going to happen as expected.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/CancelAction\">CancelAction</a>: The antonym of ConfirmAction.</li>\n</ul>\n'),(924,14,11,'Room','Room','A room is a distinguishable space within a structure, usually separated from other spaces by interior walls. (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Room\">http://en.wikipedia.org/wiki/Room</a>).\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),(925,14,11,'MusicReleaseFormatType','MusicReleaseFormatType','Format of this release (the type of recording media used, ie. compact disc, digital media, LP, etc.).'),(926,14,11,'AutoPartsStore','AutoPartsStore','An auto parts store.'),(927,14,11,'AdministrativeArea','AdministrativeArea','A geographical region, typically under the jurisdiction of a particular government.'),(928,14,11,'ArtGallery','ArtGallery','An art gallery.'),(929,14,11,'MensClothingStore','MensClothingStore','A men\'s clothing store.'),(930,14,11,'GovernmentOffice','GovernmentOffice','A government office&#x2014;for example, an IRS or DMV office.'),(931,14,11,'UserPageVisits','UserPageVisits','UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>-based vocabulary, alongside types such as <a class=\"localLink\" href=\"http://schema.org/Comment\">Comment</a>.'),(932,14,11,'TVSeries','TVSeries','CreativeWorkSeries dedicated to TV broadcast and associated online delivery.'),(933,14,11,'PawnShop','PawnShop','A shop that will buy, or lend money against the security of, personal possessions.'),(934,14,11,'UserLikes','UserLikes','UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>-based vocabulary, alongside types such as <a class=\"localLink\" href=\"http://schema.org/Comment\">Comment</a>.'),(935,14,11,'ImageObject','ImageObject','An image file.'),(936,14,11,'Brewery','Brewery','Brewery.'),(937,14,11,'BusReservation','BusReservation','A reservation for bus travel. <br/><br/>\n\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, use <a class=\"localLink\" href=\"http://schema.org/Offer\">Offer</a>.'),(938,14,11,'MusicAlbumReleaseType','MusicAlbumReleaseType','The kind of release which this album is: single, EP or album.'),(939,14,11,'PoliceStation','PoliceStation','A police station.'),(940,14,11,'QAPage','QAPage','A QAPage is a WebPage focussed on a specific Question and its Answer(s), e.g. in a question answering site or documenting Frequently Asked Questions (FAQs).'),(941,14,11,'AggregateOffer','AggregateOffer','When a single product is associated with multiple offers (for example, the same pair of shoes is offered by different merchants), then AggregateOffer can be used.'),(942,14,11,'RentAction','RentAction','The act of giving money in return for temporary use, but not ownership, of an object such as a vehicle or property. For example, an agent rents a property from a landlord in exchange for a periodic payment.'),(943,14,11,'TheaterEvent','TheaterEvent','Event type: Theater performance.'),(944,14,11,'ComedyEvent','ComedyEvent','Event type: Comedy event.'),(945,14,11,'InternetCafe','InternetCafe','An internet cafe.'),(946,14,11,'LandmarksOrHistoricalBuildings','LandmarksOrHistoricalBuildings','An historical landmark or building.'),(947,14,11,'AutoBodyShop','AutoBodyShop','Auto body shop.'),(948,14,11,'Hostel','Hostel','A hostel - cheap accommodation, often in shared dormitories.\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),(949,14,11,'Festival','Festival','Event type: Festival.'),(950,14,11,'CreativeWorkSeries','CreativeWorkSeries','A CreativeWorkSeries in schema.org is a group of related items, typically but not necessarily of the same kind. CreativeWorkSeries are usually organized into some order, often chronological. Unlike <a class=\"localLink\" href=\"http://schema.org/ItemList\">ItemList</a> which is a general purpose data structure for lists of things, the emphasis with CreativeWorkSeries is on published materials (written e.g. books and periodicals, or media such as tv, radio and games).<br/><br/>\n\nSpecific subtypes are available for describing <a class=\"localLink\" href=\"http://schema.org/TVSeries\">TVSeries</a>, <a class=\"localLink\" href=\"http://schema.org/RadioSeries\">RadioSeries</a>, <a class=\"localLink\" href=\"http://schema.org/MovieSeries\">MovieSeries</a>, <a class=\"localLink\" href=\"http://schema.org/BookSeries\">BookSeries</a>, <a class=\"localLink\" href=\"http://schema.org/Periodical\">Periodical</a> and <a class=\"localLink\" href=\"http://schema.org/VideoGameSeries\">VideoGameSeries</a>. In each case, the <a class=\"localLink\" href=\"http://schema.org/hasPart\">hasPart</a> / <a class=\"localLink\" href=\"http://schema.org/isPartOf\">isPartOf</a> properties can be used to relate the CreativeWorkSeries to its parts. The general CreativeWorkSeries type serves largely just to organize these more specific and practical subtypes.<br/><br/>\n\nIt is common for properties applicable to an item from the series to be usefully applied to the containing group. Schema.org attempts to anticipate some of these cases, but publishers should be free to apply properties of the series parts to the series as a whole wherever they seem appropriate.'),(951,14,11,'BroadcastChannel','BroadcastChannel','A unique instance of a BroadcastService on a CableOrSatelliteService lineup.'),(952,14,11,'BefriendAction','BefriendAction','The act of forming a personal connection with someone (object) mutually/bidirectionally/symmetrically.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/FollowAction\">FollowAction</a>: Unlike FollowAction, BefriendAction implies that the connection is reciprocal.</li>\n</ul>\n'),(953,14,11,'GameServer','GameServer','Server that provides game interaction in a multiplayer game.'),(954,14,11,'TelevisionStation','TelevisionStation','A television station.'),(955,14,11,'Book','Book','A book.'),(956,14,11,'Airline','Airline','An organization that provides flights for passengers.'),(957,14,11,'LegislativeBuilding','LegislativeBuilding','A legislative building&#x2014;for example, the state capitol.'),(958,14,11,'PaintAction','PaintAction','The act of producing a painting, typically with paint and canvas as instruments.'),(959,14,11,'RentalCarReservation','RentalCarReservation','A reservation for a rental car.<br/><br/>\n\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations.'),(960,14,11,'CourseInstance','CourseInstance','An instance of a <a class=\"localLink\" href=\"http://schema.org/Course\">Course</a> which is distinct from other instances because it is offered at a different time or location or through different media or modes of study or to a specific section of students.'),(961,14,11,'ListenAction','ListenAction','The act of consuming audio content.'),(962,14,11,'AgreeAction','AgreeAction','The act of expressing a consistency of opinion with the object. An agent agrees to/about an object (a proposition, topic or theme) with participants.'),(963,14,11,'GeoCoordinates','GeoCoordinates','The geographic coordinates of a place or event.'),(964,14,11,'Electrician','Electrician','An electrician.'),(965,14,11,'WebApplication','WebApplication','Web applications.'),(966,14,11,'CafeOrCoffeeShop','CafeOrCoffeeShop','A cafe or coffee shop.'),(967,14,11,'GiveAction','GiveAction','The act of transferring ownership of an object to a destination. Reciprocal of TakeAction.<br/><br/>\n\nRelated actions:<br/><br/>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/TakeAction\">TakeAction</a>: Reciprocal of GiveAction.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/SendAction\">SendAction</a>: Unlike SendAction, GiveAction implies that ownership is being transferred (e.g. I may send my laptop to you, but that doesn\'t mean I\'m giving it to you).</li>\n</ul>\n'),(968,14,11,'Canal','Canal','A canal, like the Panama Canal.'),(969,13,12,'Action','Action','Could capture Action and Action source (properties to indicate page-folio could be set directly on Activity). A production or scribing(!) could be modelled as an Activity.'),(970,13,12,'BookObject','BookObject',NULL),(971,13,12,'DataSource','DataSource',NULL),(972,13,12,'Group','Group','An instution is regarded as a Group.'),(973,13,12,'Identifier','Identifier','Used for former or current identifiers. Can be typed as VIAF or STC.'),(974,13,12,'Institution','Institution',NULL),(975,13,12,'Manuscript','Manuscript',NULL),(976,13,12,'MedievalInstitution','MedievalInstitution',NULL),(977,13,12,'ModernInstitution','ModernInstitution',NULL),(978,13,12,'NonBookObject','NonBookObject',NULL),(979,13,12,'Person','Person',NULL),(980,13,12,'Place','Place',NULL),(981,13,12,'Print','Print',NULL),(982,13,12,'TimeSpan','TimeSpan',NULL),(983,13,12,'Work','Work',NULL),(984,13,12,'WorkItem','WorkItem',NULL),(985,13,12,'WrittenText','WrittenText','Could be used as Work_Item'),(986,13,15,'Class','Class','The class of classes.'),(987,13,15,'Resource','Resource','The class resource, everything.'),(988,13,15,'Container','Container','The class of RDF containers.'),(989,13,15,'ContainerMembershipProperty','ContainerMembershipProperty','The class of container membership properties, rdf:_1, rdf:_2, ..., all of which are sub-properties of \'member\'.'),(990,13,15,'Datatype','Datatype','The class of RDF datatypes.'),(991,13,15,'Literal','Literal','The class of literal values, eg. textual strings and integers.'),(1009,1,17,'Concept','Concept',NULL),(1010,1,17,'ConceptScheme','Concept Scheme',NULL),(1011,1,17,'Collection','Collection',NULL),(1012,1,17,'OrderedCollection','Ordered Collection',NULL);
