INSERT INTO "site_page_block" VALUES (1,1,'html','{\"html\":\"<h1 dir=\\\"ltr\\\"><strong>DIGITAL BIRGITTA<\\/strong> is an open-access, multi-feature database of books and objects related to St. Birgitta of Sweden and Syon Abbey, that survive from medieval England. It integrates:<\\/h1>\\r\\n\\r\\n<ul dir=\\\"ltr\\\">\\r\\n\\t<li><strong>Database entries<\\/strong> of books, works, people, and places &nbsp;provide a wealth of information about all traces of Birgitta in England before the Reformation.&nbsp;The database uses linked data, which means that entries connect to each other and thus facilitate exploration of all the connections between entries<b>.<\\/b><\\/li>\\r\\n\\t<li><strong>Network graphs<\\/strong> visualize the relationship between these books, people, places, and institutions.<\\/li>\\r\\n\\t<li><strong>Digital editions<\\/strong> offer new, accessible editions of specific Birgittine texts, while manuscript image viewers give an instant view in to specific manuscripts.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>By searching in <strong>DIGITAL BIRGITTA<\\/strong> you can discover new connections between texts, readers, and textual communities&nbsp;that help to show&nbsp;the full breadth of Birgitta&rsquo;s influence. <b>&nbsp;<\\/b><\\/p>\\r\\n\\r\\n<h3>&nbsp;<\\/h3>\\r\\n\\r\\n<h2>SCOPE<\\/h2>\\r\\n\\r\\n<p><strong>DIGITAL BIRGITTA<\\/strong> includes:<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li aria-level=\\\"1\\\" dir=\\\"ltr\\\">\\r\\n\\t<p dir=\\\"ltr\\\" role=\\\"presentation\\\">all the instances of the Revelations and related texts, in both Latin and Middle English, that originated in England or were known in medieval England<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li aria-level=\\\"1\\\" dir=\\\"ltr\\\">\\r\\n\\t<p dir=\\\"ltr\\\" role=\\\"presentation\\\"><b id=\\\"docs-internal-guid-b034cf81-7fff-6217-9f27-2f7148fe4da9\\\">i<\\/b>ndividually copied excerpts from the Revelations, in both Latin and Middle English<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li aria-level=\\\"1\\\" dir=\\\"ltr\\\">\\r\\n\\t<p dir=\\\"ltr\\\" role=\\\"presentation\\\">devotional compilations, in both Latin and Middle English, that borrow from the Revelations<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li aria-level=\\\"1\\\" dir=\\\"ltr\\\">\\r\\n\\t<p dir=\\\"ltr\\\" role=\\\"presentation\\\">any other sources, book objects or otherwise, that refer to Birgitta or show reception of her Revelations<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li aria-level=\\\"1\\\" dir=\\\"ltr\\\">\\r\\n\\t<p dir=\\\"ltr\\\" role=\\\"presentation\\\">many of the books owned by members (especially nuns) of Syon Abbey, the sole Birgittine house in England<\\/p>\\r\\n\\t<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<div style=\\\"background:#eeeeee;border:1px solid #cccccc;padding:5px 10px;\\\">\\r\\n<h2><b id=\\\"docs-internal-guid-b034cf81-7fff-6217-9f27-2f7148fe4da9\\\">WAYS TO USE DIGITAL BIRGITTA<\\/b><\\/h2>\\r\\n\\r\\n<p dir=\\\"ltr\\\"><b id=\\\"docs-internal-guid-b034cf81-7fff-6217-9f27-2f7148fe4da9\\\">BROWSE<\\/b><\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\">To browse the database entries, click on one of the menu items above: Books &amp; Manuscripts; Works; People; Places; Bibliography. These lead directly to full lists.<\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\"><b id=\\\"docs-internal-guid-b034cf81-7fff-6217-9f27-2f7148fe4da9\\\">NETWORKS<\\/b><\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\">To generate network graphs from the database, click<b> <\\/b><\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\"><b id=\\\"docs-internal-guid-b034cf81-7fff-6217-9f27-2f7148fe4da9\\\">DIGITAL EDITIONS<\\/b><\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\">To access a full list of all the editions, click on the menu item above: Editions.<b>&nbsp;<\\/b><\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\"><b>SEARCH<\\/b><\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\">To search all entries enter a search term in the search box below. There is also an advanced search form located&nbsp;<a href=\\\"https:\\/\\/birgitta.test.uib.no\\/s\\/birgitta\\/item\\/search?sort_by=created&amp;sort_order=desc&amp;page=1\\\" target=\\\"_blank\\\">here<\\/a>.<\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\"><b id=\\\"docs-internal-guid-b034cf81-7fff-6217-9f27-2f7148fe4da9\\\">EXPORT<\\/b><\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\">All the data in DIGITAL BIRGITTA is Open Access and free to download. Each entry contains export links at the bottom of the page. [directions for mass export?]<\\/p>\\r\\n<\\/div>\\r\\n\"}',1),(2,1,'itemShowCase','{\"thumbnail_type\":\"large\",\"show_title_option\":\"item_title\"}',2),(3,1,'mappingMap','{\"bounds\":\"-3.7080039874749025,50.70480232201862,4.026371012525099,52.745930866250134\",\"wms\":[]}',3),(4,2,'pageTitle','[]',1),(5,3,'pageTitle','[]',1),(6,4,'pageTitle','[]',1),(7,5,'pageTitle','[]',1),(8,6,'pageTitle','[]',1),(10,8,'pageTitle','[]',1),(11,9,'pageTitle','[]',1),(12,3,'browsePreview','{\"resource_type\":\"items\",\"query\":\"resource_class_id%5B%5D=&resource_template_id%5B%5D=14&sort_by=title&sort_order=asc\",\"limit\":\"100\",\"heading\":\"\",\"link-text\":\"\"}',2),(13,4,'browsePreview','{\"resource_type\":\"items\",\"query\":\"fulltext_search=&property%5B0%5D%5Bjoiner%5D=and&property%5B0%5D%5Bproperty%5D=&property%5B0%5D%5Btype%5D=eq&property%5B0%5D%5Btext%5D=&resource_class_id%5B%5D=&resource_template_id%5B%5D=19&item_set_id%5B%5D=&site_id=&submit=Search&sort_by=title&sort_order=asc\",\"limit\":\"100\",\"heading\":\"\",\"link-text\":\"\"}',2),(14,2,'browsePreview','{\"resource_type\":\"items\",\"query\":\"resource_class_id%5B%5D=&resource_template_id%5B%5D=13&item_set_id%5B%5D&sort_by=schema:name&sort_order=asc\",\"limit\":\"100\",\"heading\":\"\",\"link-text\":\"\"}',2),(17,5,'browsePreview','{\"resource_type\":\"items\",\"query\":\"fulltext_search=&property%5B0%5D%5Bjoiner%5D=and&property%5B0%5D%5Bproperty%5D=&property%5B0%5D%5Btype%5D=eq&property%5B0%5D%5Btext%5D=&resource_class_id%5B%5D=&resource_template_id%5B%5D=16&item_set_id%5B%5D=&site_id=&submit=Search&sort_by=title&sort_order=asc\",\"limit\":\"100\",\"heading\":\"\",\"link-text\":\"\"}',2),(18,11,'pageTitle','[]',1),(19,11,'browsePreview','{\"resource_type\":\"items\",\"query\":\"\",\"limit\":\"12\",\"heading\":\"\",\"link-text\":\"Browse all\"}',2),(21,12,'pageTitle','[]',1),(22,12,'html','{\"html\":\"<h1>Build your network<\\/h1>\\r\\n\\r\\n<p>Instructions about how to use the network viewer here.&nbsp;<\\/p>\\r\\n\\r\\n<p><iframe src=\\\"https:\\/\\/birgitta.networks.uib.no\\/\\/\\\" style=\\\"width: 100vh; height: 100vh\\\" title=\\\"Build your network\\\"><\\/iframe><\\/p>\\r\\n\"}',2),(25,14,'pageTitle','[]',1),(26,14,'html','{\"html\":\"<p>This is where we can write a good instructive text about digital editions and what they are good for.<\\/p>\\r\\n\"}',2),(27,14,'lineBreak','{\"break_type\":\"opaque\"}',3),(28,14,'html','{\"html\":\"<h3>This is the header for my first digital edition<\\/h3>\\r\\n\\r\\n<p>This is the description for my first digital edition.<\\/p>\\r\\n\"}',4),(29,14,'html','{\"html\":\"<p><a href=\\\"https:\\/\\/birgitta.networks.uib.no\\/viewer\\/#\\/imgTxt?d=doc_1&amp;p=page_1&amp;e=diplomatic&amp;ce=interpretative\\\" target=\\\"_blank\\\">Click here to view the edition in a separate tab<\\/a><\\/p>\\r\\n\\r\\n<p><iframe height=\\\"500\\\" src=\\\"https:\\/\\/birgitta.networks.uib.no\\/viewer\\/#\\/imgTxt?d=doc_1&amp;p=page_1&amp;e=diplomatic&amp;ce=interpretative\\\" style=\\\"height: 501.5px;\\\" title=\\\"My digital edition\\\" width=\\\"800\\\"><\\/iframe><\\/p>\\r\\n\"}',5),(33,15,'pageTitle','[]',1),(34,15,'searchForm','{\"heading\":\"\"}',2),(36,16,'html','{\"html\":\"Welcome to your new site. This is an example page.\"}',1);
