,(4412,472,1,NULL,'literal',NULL,'Meditation (inc. Lord graunte vs helpe in oure tribulacion. I haue ofte in my mynde thought. I wolde I were delyuered) (BL, Arundel MS 197)',NULL,1),(4413,472,1292,NULL,'literal',NULL,'English, Middle',NULL,1),(4414,472,1744,NULL,'xsd:boolean',NULL,'0',NULL,1),(4415,454,1208,472,'resource:item',NULL,NULL,NULL,1),(4416,454,1737,NULL,'literal',NULL,'London, British Library, Arundel MS 197',NULL,1),(4417,454,1709,134,'resource:item',NULL,NULL,NULL,1),(4418,454,1690,NULL,'literal',NULL,'1450-75',NULL,1),(4419,454,1730,NULL,'xsd:boolean',NULL,'0',NULL,0),(4420,454,1744,NULL,'xsd:boolean',NULL,'1',NULL,1),(4421,454,1743,NULL,'literal',NULL,'Ayto and Barratt (1984)\nConnolly (1994)\nPezzini (1988)',NULL,1),(4422,454,1722,NULL,'xsd:boolean',NULL,'0',NULL,0),(4423,454,1636,NULL,'literal',NULL,'Connolly (1994): The first five items, none of which is complete, form a collection of meditative material which is given the general heading \'Fervor Amoris\'. This heading is used elsewhere as a title for the text more familiarly known as Contemplations ofthe Dread and Love of God, the seventh item in Arundel 197.* The appearance of this heading at the top off. 1r is interesting, and must be either a mistake on the part of the scribe, or, as seems more likely, given the sequence and nature of these short texts, evidence of an attempt to compose a new work altogether, possibly re-writing Contemplations in the process. Redrafting is a characteristic of the manuscript as a whole. What is curious about this otherwise unremarkable collection of devotional pieces is that the text of each work has been subjected to extensive revision, with lengthy additions and omissions, and many corrections to individual words and phrases. The result is that the texts within Arundel 197 differ significantly from their other witnesses elsewhere.',NULL,1),(4424,454,1739,NULL,'literal',NULL,'Parchment',NULL,1),(4425,454,1727,NULL,'literal',NULL,'192 x 132 mm',NULL,1),(4426,4