ionibus primo universaliter\' (129r-137r), and \'tractatus 2 de electionibus particularibus\' (ff. 137r-143v); imperfect; includes an extract from Haly ibn Ragel [ëAli ibn abi ír-Rijal], De iudiciis astrorum (ff. 143v-147v).\nff. 148r-186v: Tractatus nonus \'De nativitatibus\' in 4 parts.\nff. 187r-200v: Tractatus quintus \'De considerationibus.\'\nff. 201r-243v: Tractatus optimus \'De revolutionibus annorum mundi\' in 2 parts. \nff. 243v-248r: Tractatus decimus \'Tractatus de imbribus et aeris\'.',NULL,1),(6723,762,1,NULL,'literal',NULL,'Alfonsine tables',NULL,1),(6724,762,1744,NULL,'xsd:boolean',NULL,'0',NULL,1),(6725,763,941,749,'resource:item',NULL,NULL,NULL,1),(6726,763,889,762,'resource:item',NULL,NULL,NULL,1),(6727,763,1,NULL,'literal',NULL,'Astronomical tables known as the \'Alfonsine Tables\', with canons (extract) (BL, Arundel MS 66)',NULL,1),(6728,763,1097,NULL,'literal',NULL,'5',NULL,1),(6729,763,1726,NULL,'literal',NULL,'Gothic hybrid',NULL,1),(6730,763,1292,NULL,'literal',NULL,'Latin',NULL,1),(6731,763,1744,NULL,'xsd:boolean',NULL,'0',NULL,1),(6732,763,1739,NULL,'literal',NULL,'Parchment',NULL,1),(6733,763,1760,NULL,'literal',NULL,'ff. 250r-266v',NULL,1),(6734,764,1490,NULL,'valuesuggest:oclc:viaf',NULL,'Geoffrey of Monmouth, 1100-1154','http://www.viaf.org/viaf/89028232',1),(6735,764,1721,NULL,'xsd:boolean',NULL,'0',NULL,0),(6736,764,1724,NULL,'xsd:boolean',NULL,'0',NULL,0),(6737,765,886,764,'resource:item',NULL,NULL,NULL,1),(6738,765,1,NULL,'literal',NULL,'Prophetiae Merlini',NULL,1),(6739,765,1292,NULL,'literal',NULL,'Latin',NULL,1),(6740,765,1744,NULL,'xsd:boolean',NULL,'0',NULL,1),(6742,766,941,749,'resource:item',NULL,NULL,NULL,1),(6743,766,889,765,'resource:item',NULL,NULL,NULL,1),(6744,766,1,NULL,'literal',NULL,'Prophecies of Merlin (Geoffrey of Monmouth, Historia regum Britanniae) (BL, Arundel MS 66)',NULL,1),(6745,766,1097,NULL,'literal',NULL,'6',NULL,1),(6746,766,1726,NULL,'literal',NULL,'Gothic hybrid',NULL,1),(6747,766,1292,NULL,'literal',