NULL,'xsd:boolean',NULL,'0',NULL,0),(6884,790,1636,NULL,'literal',NULL,'Genealogical roll that was commissioned to celebrate the English king Edward IV\'s (1442-1483) accession to the throne after he deposed Henry VI',NULL,1),(6885,790,1739,NULL,'literal',NULL,'Parchment',NULL,1),(6886,791,941,790,'resource:item',NULL,NULL,NULL,1),(6887,791,889,794,'resource:item',NULL,NULL,NULL,1),(6888,791,1,NULL,'literal',NULL,'Genealogy of Edward IV, including a Chronicle of the World from Creation (Philadelphia, Free Library, MS Lewis E 201)',NULL,1),(6889,791,1726,NULL,'literal',NULL,'Secretary',NULL,1),(6890,791,1690,NULL,'literal',NULL,'1475',NULL,1),(6891,791,1292,NULL,'literal',NULL,'Latin',NULL,1),(6892,791,1744,NULL,'xsd:boolean',NULL,'0',NULL,1),(6893,791,1636,NULL,'literal',NULL,'By placing his ancestry within the framework of world history as it was understood at the time, Edward IV could claim hereditary and God-given rights to the throne of England. It illustrates Edward\'s ties to the royal and aristocratic families of England, France and Spain.  Edward\'s genealogy ends with his name inscribed above a prayer enclosed in interlaced rectangles and surrounded by symbols of kingship.',NULL,1),(6894,791,1739,NULL,'literal',NULL,'Parchment',NULL,1),(6895,792,941,790,'resource:item',NULL,NULL,NULL,1),(6896,792,889,1245,'resource:item',NULL,NULL,NULL,1),(6897,792,1,NULL,'literal',NULL,'Extract from Revelations (Philadelphia, Free Library, MS Lewis E 201)',NULL,1),(6898,792,1726,NULL,'literal',NULL,'Secretary',NULL,1),(6899,792,1690,NULL,'literal',NULL,'1475',NULL,1),(6900,792,1292,NULL,'literal',NULL,'Latin',NULL,1),(6901,792,1744,NULL,'xsd:boolean',NULL,'1',NULL,1),(6902,792,1743,NULL,'literal',NULL,'Rev 4.3 selection',NULL,1),(6903,792,1636,NULL,'literal',NULL,'Edward\'s genealogy ends in this section with his name inscribed above a prayer enclosed in interlaced rectangles and surrounded by symbols of kingship. The prayer includes mention of Birgitta\'s name and extract